n                【容器服务】容器服务介绍\n              </a>\n            </p>\n            <p class=\"v-notification\">\n              <a href=\"/paas/product/help?id=3\" class=\"\">\n                【容器服务】容器维护指南\n              </a>\n            </p>\n            <p class=\"v-notification\">\n              <a href=\"/paas/product/help?id=3&amp;info=3-1\" class=\"\">\n                【容器服务】容器创建指南\n              </a>\n            </p>\n            <p class=\"v-notification\">\n              <a href=\"/paas/product/help?id=5\" class=\"\">\n                【容器服务】镜像管理\n              </a>\n            </p>\n            <p class=\"v-notification look-all-help\">\n              <a href=\"/paas/product/help\" class=\"\">\n                查看全部  &gt;&gt;\n              </a>\n            </p>\n          </div>\n        </div>\n      </div>\n      <div class=\"innerDrag normal \" data-moduleres=\"\">\n        <div class=\"v-toolBar\">\n          <a href=\"#\" class=\"\">\n            <i class=\"glyphicon glyphicon-move\">\n            </i>\n            &nbsp;    \n          </a>\n          <a href=\"#\" class=\"\">\n            <i class=\"glyphicon glyphicon-trash\">\n            </i>\n            &nbsp;    \n          </a>\n          <a href=\"#\" class=\"\">\n            <i class=\"glyphicon glyphicon-edit\">\n            </i>\n            &nbsp;    \n          </a>\n        </div>\n        <div class=\"panel panel-default help-document sys-help-document\">\n          <div class=\"panel-heading\">\n            <h3 class=\"panel-title\">\n              系统帮助\n            </h3>\n          </div>\n          <div class=\"panel-body normal drop-helper\">\n            <p class=\"v-notification\">\n              【MySQL数据库】MySQL服务管理\n            </p>\n            <p class=\"v-notification\">\n              【MySQL数据库】实例创建\n            </p>\n            <p class=\"v-notification\">\n              【MySQL数据库】日志查看\n            </p>\n            <p class=\"v-notification\">\n              【MySQL数据库】My