INSERT INTO `page_model` VALUES ('2fa8fdaaa21211e9b26a1402ec7d7650', 'admin', '2019-08-08 09:31:22', 'tenant_system', 'admin', '2019-08-13 10:18:45', '<script type=\"text/javascript\" id=\"809544c8739011e88b091402ec8b0a88\" data-count=\"0\" src=\"../../../v1/pageRes/res/file/809544c8739011e88b091402ec8b0a88\"></script>\r\n<script id=\"3799095848js\">$.ajax({\n  url: $webpath+\"/propconfig/specification/version\",\n  type: \'GET\',\n  dataType: \"json\",\n  contentType: \'application/json\',\n  success: function (res) {\n  if(res.code === 200) {\n  $(\'#footer-version .footer-version-info\').html(res.data);\n}\n       }\n       }\n      );\n</script>\r\n<script id=\"a400cd0348js\">// 查询项目表\ninitProjectGlyph();\nfunction initProjectGlyph() {\n    $.ajax({\n        url: $webpath + \'/console/v1/project/allProProject\',\n        method: \'POST\',\n        contentType: \"application/json;charset=utf-8\",\n        dataType: \"json\",\n        data: JSON.stringify({\n            \"pageNo\": 1,\n            \"pageSize\": 10000\n        }\n        ),\n        success: function (result) {\n            if (result.code === 0) {\n                var html = \"\";\n                if (result.data.data.length > 0) {\n                    $(\'#projectCardList\').empty();\n                    $(\'#hasProjectShow\').show();\n                    $(\'#noProjectShow\').hide();\n                    // 有项目\n                    $.each(result.data.data, function (index, item) {\n                        var projectId = item.projectId;\n                        var projectIcon = item.profile ? item.profile : \'profile1\';\n                        var projectResume = item.projectResume;\n                        if (projectResume.length > 13) {\n                            projectResume = projectResume.substring(0, 13) + \'…\';\n                        }\n                        var html = \'<div class=\"panel panel-default resource-usage\" id=\"\' + item.projectId + \'\">\\n\' +\n                            \'    <div class=\"panel-heading\">\\n\' +\n                            \'        <div class=\"heading-inner\" onclick=\"goToDashboard(\\\'\' + item.projectId + \'\\\',\\\'\' + item.projectName + \'\\\')\">\\n\' +\n                            \'           <img src=\"\' + $resContextPath + \'/img/bcm/project/\' + projectIcon + \'.png\" alt=\"\">\\n\' +\n                            \'           <h3 class=\"panel-title\">\' + item.projectName + \'</h3>\\n\' +\n                            \'        </div>\\n\' +\n                            \'    </div>\\n\' +\n                            \'    <div class=\"panel-body normal drop-helper \" style=\"padding:15px 0;padding-top:6px\">\\n\' +\n                            \'        <div class=\"col-md-12 project-info\">\\n\' +\n                            \'            <div class=\"col-md-3\">\\n\' +\n                            \'                <div class=\"pro-card-info project-info-show\">\\n\' +\n                            \'                    <p>项目名称：<span>\' + item.projectName + \'</span></p>\\n\' +\n                            \'                    <p>创建时间：<span>\' + timestampToTime(item.createTime) + \'</span></p>\\n\' +\n                            \'                    <p>项目描述：<span title=\"\' + item.projectResume + \'\">\' + projectResume + \'</span></p>\\n\' +\n                            \'                </div>\\n\' +\n                            \'            </div>\\n\' +\n                            \'            <div class=\"col-md-2\">\\n\' +\n                            \'                <a href=\"javascript:void(0);\" style=\"cursor: default;\" class=\"\">\\n\' +\n                            \'                    <div class=\"pro-card-info pro-info-num\">\\n\' +\n                            \'                        <p class=\"num proNum\">\' + item.usersNum + \'</p>\\n\' +\n                            \'                        <p class=\"\">成员数量</p>\\n\' +\n                            \'                    </div>\\n\' +\n                            \'                </a>\\n\' +\n                            \'            </div>\\n\' +\n                            \'            <div class=\"col-md-2\">\\n\' +\n                            \'                <a href=\"javascript:void(0);\" style=\"cursor: default;\" class=\"\">\\n\' +\n                            \'                    <div class=\"pro-card-info pro-info-num\">\\n\' +\n                            \'                        <p class=\"num appNum\">0</p>\\n\' +\n                            \'                        <p class=\"\">应用数量</p>\\n\' +\n                            \'                    </div>\\n\' +\n                            \'                </a>\\n\' +\n                            \'            </div>\\n\' +\n                            \'            <div class=\"col-md-2\">\\n\' +\n                            \'                <a href=\"javascript:void(0);\" style=\"cursor: default;\" class=\"\">\\n\' +\n                            \'                    <div class=\"pro-card-info pro-info-num\">\\n\' +\n                            \'                        <p class=\"num serviceNum\">0</p>\\n\' +\n                            \'                        <p class=\"\">服务数量</p>\\n\' +\n                            \'                    </div>\\n\' +\n                            \'                </a>\\n\' +\n                            \'            </div>\\n\' +\n                            \'            <div class=\"col-md-3\" style=\"padding-top:0px\">\\n\' +\n                            \'                <a href=\"javascript:void(0);\" style=\"cursor: default;\" class=\"\">\\n\' +\n                            \'                    <div class=\"pro-card-info pro-info-warning\">\\n\' +\n                            \'                        <div id=\"\' + item.projectId + \'-chart\" style=\"width: 100%; height: 130%;\">\\n\' +\n                            \'                        </div>\\n\' +\n                            \'                    </div>\\n\' +\n                            \'                </a>\\n\' +\n                            \'            </div>\\n\' +\n                            \'        </div>\\n\' +\n                            \'        <div class=\"col-md-12 quota-process\">\\n\' +\n                            \'            <div class=\"quota-process-container\">\\n\' +\n                            \'                <div class=\"process-item process-cpu\">\\n\' +\n                            getItemProcessHtml() +\n                            \'                    <span class=\"item-name\">CPU</span>\\n\' +\n                            \'                    <span class=\"item-value\"><span class=\"text\">0/0</span><span>(核)</span></span>\\n\' +\n                            \'                </div>\\n\' +\n                            \'                <div class=\"process-item process-memory\">\\n\' +\n                            getItemProcessHtml() +\n                            \'                    <span class=\"item-name\">内存</span>\\n\' +\n                            \'                    <span class=\"item-value\"><span class=\"text\">0/0</span><span>(GB)</span></span>\\n\' +\n                            \'                </div>\\n\' +\n                            \'                <div class=\"process-item process-storage\">\\n\' +\n                            getItemProcessHtml() +\n                            \'                    <span class=\"item-name\">存储</span>\\n\' +\n                            \'                    <span class=\"item-value\"><span class=\"text\">0/0</span><span>(GB)</span></span>\\n\' +\n                            \'                </div>\\n\' +\n                            \'            </div>\\n\' +\n                            \'            <div class=\"process-item value-content\">\\n\' +\n                            \'                <div class=\"item-process\" style=\"padding-top:5px;\">\\n\' +\n                            \'                    <div class=\"progress\" style=\"background-color: #fff\">\\n\' +\n                            \'                        <div class=\"line-0 c-line\" style=\"border-left:none;\">\\n\' +\n                            \'                            <span class=\"inner-number\">0%</span>\\n\' +\n                            \'                        </div>\\n\' +\n                            \'                        <div class=\"line-1 c-line\">\\n\' +\n                            \'                            <span class=\"inner-number\">10%</span>\\n\' +\n                            \'                        </div>\\n\' +\n                            \'                        <div class=\"line-2 c-line\">\\n\' +\n                            \'                            <span class=\"inner-number\">20%</span>\\n\' +\n                            \'                        </div>\\n\' +\n                            \'                        <div class=\"line-3 c-line\">\\n\' +\n                            \'                            <span class=\"inner-number\">30%</span>\\n\' +\n                            \'                        </div>\\n\' +\n                            \'                        <div class=\"line-4 c-line\">\\n\' +\n                            \'                            <span class=\"inner-number\">40%</span>\\n\' +\n                            \'                        </div>\\n\' +\n                            \'                        <div class=\"line-5 c-line\">\\n\' +\n                            \'                            <span class=\"inner-number\">50%</span>\\n\' +\n                            \'                        </div>\\n\' +\n                            \'                        <div class=\"line-6 c-line\">\\n\' +\n                            \'                            <span class=\"inner-number\">60%</span>\\n\' +\n                            \'                        </div>\\n\' +\n                            \'                        <div class=\"line-7 c-line\">\\n\' +\n                            \'                            <span class=\"inner-number\">70%</span>\\n\' +\n                            \'                        </div>\\n\' +\n                            \'                        <div class=\"line-8 c-line\">\\n\' +\n                            \'                            <span class=\"inner-number\">80%</span>\\n\' +\n                            \'                        </div>\\n\' +\n                            \'                        <div class=\"line-9 c-line\">\\n\' +\n                            \'                            <span class=\"inner-number\">90%</span>\\n\' +\n                            \'                            <span class=\"lat-number\">100%</span>\\n\' +\n                            \'                        </div>\\n\' +\n                            \'                    </div>\\n\' +\n                            \'                </div>\\n\' +\n                            \'            </div>\\n\' +\n                            \'        </div>\\n\' +\n                            \'    </div>\\n\' +\n                            \'</div>\';\n                        $(\'#projectCardList\').append(html);\n                        getCount(projectId, item.tenantId);\n                        getQuota(projectId);\n                        drawChart(projectId);\n                    }\n                    );\n                    // $(\'#projectCardList\').html(html);\n                    // $(\'#hasProjectShow\').show();\n                    // $(\'#noProjectShow\').hide();\n                }\n                else {\n                    // 无项目\n                    $(\'#hasProjectShow\').hide();\n                    $(\'#noProjectShow\').show();\n                    $(\'#noProjectShow img.no-project-img\').attr(\'src\', $resContextPath + \'/img/bcm/project/no_project.png\')\n                }\n            }\n        }\n    }\n    );\n}\n// 跳转项目dashboard\nfunction goToDashboard(projectId, projectName) {\n    $.ajax({\n        url: $webpath + \"/console/v1/project/setId?projectId=\" + projectId,\n        type: \"GET\",\n        contentType: \"application/json;charset=utf-8\",\n        dataType: \"json\",\n        success: function (result) {\n            if (result.code === 0) {\n                $(\"#top_area1\", window.parent.document).find(\'.nav-left-project .dropdown-toggle>span\').html(projectName);\n                window.location.href = $webpath + \"/v1/pageModel/pageTemplate/ed14c73bfe7811e8ad011402ec81c25c?projectId=\" + projectId;\n            }\n        }\n    }\n    );\n}\n//时间戳转换\nfunction timestampToTime(timestamp) {\n    var date = new Date(timestamp);\n    //时间戳为10位需*1000，时间戳为13位的话不需乘1000\n    Y = date.getFullYear() + \'-\';\n    M = (date.getMonth() + 1 < 10 ? \'0\' + (date.getMonth() + 1) : date.getMonth() + 1) + \'-\';\n    D = (date.getDate() < 10 ? \'0\' + date.getDate() : date.getDate()) + \' \';\n    h = (date.getHours() < 10 ? \'0\' + date.getHours() : date.getHours()) + \':\';\n    m = (date.getMinutes() < 10 ? \'0\' + date.getMinutes() : date.getMinutes()) + \':\';\n    s = (date.getSeconds() < 10 ? \'0\' + date.getSeconds() : date.getSeconds());\n    return Y + M + D + h + m + s;\n}\n// 调用门户的新增项目方法\nfunction toCreateProject() {\n    window.parent.openAddProjectModal();\n}\nfunction getItemProcessHtml() {\n    return \'                    <div class=\"item-process\">\\n\' +\n        \'                        <div class=\"progress\">\\n\' +\n        \'                            <div class=\"progress-bar\" role=\"progressbar\" aria-valuenow=\"60\" aria-valuemin=\"0\"\\n\' +\n        \'                                 aria-valuemax=\"100\" style=\"width: 0%;\">\\n\' +\n        \'                                <span class=\"percent_number\">0%</span>\\n\' +\n        \'                            </div>\\n\' +\n        \'                            <div class=\"inner-line line-0\"></div>\\n\' +\n        \'                            <div class=\"inner-line  b-line  line-1\">\\n\' +\n        \'                                <div class=\"top\"></div>\\n\' +\n        \'                                <div class=\"bottom\"></div>\\n\' +\n        \'                            </div>\\n\' +\n        \'                            <div class=\"inner-line  b-line  line-2\">\\n\' +\n        \'                                <div class=\"top\"></div>\\n\' +\n        \'                                <div class=\"bottom\"></div>\\n\' +\n        \'                            </div>\\n\' +\n        \'                            <div class=\"inner-line  b-line  line-3\">\\n\' +\n        \'                                <div class=\"top\"></div>\\n\' +\n        \'                                <div class=\"bottom\"></div>\\n\' +\n        \'                            </div>\\n\' +\n        \'                            <div class=\"inner-line  b-line  line-4\">\\n\' +\n        \'                                <div class=\"top\"></div>\\n\' +\n        \'                                <div class=\"bottom\"></div>\\n\' +\n        \'                            </div>\\n\' +\n        \'                            <div class=\"inner-line  b-line  line-5\">\\n\' +\n        \'                                <div class=\"top\"></div>\\n\' +\n        \'                                <div class=\"bottom\"></div>\\n\' +\n        \'                            </div>\\n\' +\n        \'                            <div class=\"inner-line  b-line  line-6\">\\n\' +\n        \'                                <div class=\"top\"></div>\\n\' +\n        \'                                <div class=\"bottom\"></div>\\n\' +\n        \'                            </div>\\n\' +\n        \'                            <div class=\"inner-line  b-line  line-7\">\\n\' +\n        \'                                <div class=\"top\"></div>\\n\' +\n        \'                                <div class=\"bottom\"></div>\\n\' +\n        \'                            </div>\\n\' +\n        \'                            <div class=\"inner-line  b-line  line-8\">\\n\' +\n        \'                                <div class=\"top\"></div>\\n\' +\n        \'                                <div class=\"bottom\"></div>\\n\' +\n        \'                            </div>\\n\' +\n        \'                            <div class=\"inner-line  b-line  line-9\">\\n\' +\n        \'                                <div class=\"top\"></div>\\n\' +\n        \'                                <div class=\"bottom\"></div>\\n\' +\n        \'                            </div>\\n\' +\n        \'                            <div class=\"inner-line line-10\"></div>\\n\' +\n        \'                        </div>\\n\' +\n        \'                    </div>\\n\';\n}\nfunction getCount(projectId, tenantId) {\n    /*获取每个项目的应用数*/\n    $.ajax({\n        url: $webpath + \"/bcos/v1/appModel/countsByProject?projectId=\" + projectId,\n        type: \"GET\",\n        contentType: \"application/json; charset=utf-8\",\n        dataType: \"json\",\n        success: function (result) {\n            if (result) {\n                $(\"#\" + projectId + \" .appNum\").text(result);\n            }\n        }\n    }\n    );\n    /*获取每个项目的服务数*/\n    $.ajax({\n        url: $webpath + \"/bcos/v1/app/service/count?projectId=\" + projectId,\n        type: \'GET\',\n        success: function (msg) {\n            var serviceNum = 0;\n            var count = msg.data;\n            if (msg.code == \"200\") {\n                serviceNum += count.ctn;\n            }\n            $.ajax({\n                url: $webpath + \"/bcos/v1/component/service/caseCountsByTenant?tenantId=\" + tenantId + \"&projectId=\" + projectId,\n                type: \'GET\',\n                success: function (data) {\n                    if (data) {\n                        serviceNum += data.count;\n                        $(\"#\" + projectId + \" .serviceNum\").text(serviceNum);\n                    }\n                }\n            }\n            )\n        }\n    }\n    );\n}\nfunction getQuota(projectId) {\n    $.ajax({\n        url: $webpath + \"/resource/quota/project/\" + projectId,\n        type: \'GET\',\n        success: function (data) {\n            if (data) {\n                var usedCpuPer = \"0%\";\n                var usedMemoryPer = \"0%\";\n                var usedStoragePer = \"0%\";\n                cpu = Number(data.data.total.CPU);\n                usedCpu = Number(data.data.used.CPU);\n                storage = Number(data.data.total.Storage);\n                usedStorage = Number(data.data.used.Storage);\n                memory = Number(data.data.total.Memory);\n                usedMemory = Number(data.data.used.Memory);\n                console.log(cpu, usedCpu, storage, usedStorage, memory, usedMemory);\n                if (usedCpu / cpu * 100) {\n                    usedCpuPer = (usedCpu / cpu * 100).toFixed(2) + \"%\";\n                }\n                if (usedMemory / memory * 100) {\n                    usedMemoryPer = (usedMemory / memory * 100).toFixed(2) + \"%\";\n                }\n                if (usedStorage / storage * 100) {\n                    usedStoragePer = (usedStorage / storage * 100).toFixed(2) + \"%\";\n                }\n                //cpu\n                $(\"#\" + projectId + \" .process-cpu\").find(\".progress-bar\").attr(\"aria-valuemax\", data.cpu);\n                $(\"#\" + projectId + \" .process-cpu\").find(\".progress-bar\").attr(\"aria-valuenow\", data.usedCpu);\n                $(\"#\" + projectId + \" .process-cpu\").find(\".progress-bar\").css(\"width\", usedCpuPer);\n                $(\"#\" + projectId + \" .process-cpu\").find(\".percent_number\").text(usedCpuPer);\n                $(\"#\" + projectId + \" .process-cpu\").find(\".item-value .text\").text(usedCpu + \"/\" + cpu);\n                //storage\n                $(\"#\" + projectId + \" .process-storage\").find(\".progress-bar\").attr(\"aria-valuemax\", data.storage);\n                $(\"#\" + projectId + \" .process-storage\").find(\".progress-bar\").attr(\"aria-valuenow\", data.usedStorage);\n                $(\"#\" + projectId + \" .process-storage\").find(\".progress-bar\").css(\"width\", usedStoragePer);\n                $(\"#\" + projectId + \" .process-storage\").find(\".percent_number\").text(usedStoragePer);\n                $(\"#\" + projectId + \" .process-storage\").find(\".item-value .text\").text(usedStorage + \"/\" + storage);\n                //memory\n                $(\"#\" + projectId + \" .process-memory\").find(\".progress-bar\").attr(\"aria-valuemax\", data.memory);\n                $(\"#\" + projectId + \" .process-memory\").find(\".progress-bar\").attr(\"aria-valuenow\", data.usedMemory);\n                $(\"#\" + projectId + \" .process-memory\").find(\".progress-bar\").css(\"width\", usedMemoryPer);\n                $(\"#\" + projectId + \" .process-memory\").find(\".percent_number\").text(usedMemoryPer);\n                $(\"#\" + projectId + \" .process-memory\").find(\".item-value .text\").text(usedMemory + \"/\" + memory);\n            }\n        }\n    }\n    );\n}\nfunction drawChart(projectId) {\n    // var myChart = echarts.init(\"#\" + projectId + \"-chart\");\n    var myChart = echarts.init(document.getElementById(projectId + \"-chart\"));\n    var option = {\n        tooltip: {\n            trigger: \'item\',\n            formatter: \"{a} <br/>{b}: {c} ({d}%)\"\n        }\n        ,\n        legend: {\n            orient: \'vertical\',\n            x: \'right\',\n            y: \'center\',\n            left: \'60%\',\n            // data:[\'非常严重\',\'严重\',\'一般\']\n            data: [\'无告警\']\n        }\n        ,\n        graphic: {\n            type: \'text\',\n            left: \'26%\',\n            top: \'cen