_module_title\">\\n\' +\n              \'        <span>公告 | </span>\\n\' +\n                \'        <a href=\"/portal/message!listSysMsg.action\">\' + item.msgTitle+\'</a>\\n\' +\n                  \'    </span>\\n\' +\n                    \'    <span class=\"post_module_time\">\'+item.sendTime+\'</span>\\n\' +\n                      \'</p>\';\n      }\n                                  )\n      str+=\'<span class=\"round-icon-point look-all-icon\">\\n\' +\n        \'        </span>\\n\' +\n          \'        <p class=\"look-all-help\">\\n\' +\n            \'          <a href=\"/portal/message!listSysMsg.action\">查看全部  &gt;&gt;</a>\\n\' +\n              \'        </p>\';\n      $(\"#announcement .post_module_item\").html(str);\n      $(\'.post_module .v-notification\').eq(0).css(\'top\',\'-28px\');\n    }\n  }\n}\n      )\n</script>\r\n<script id=\"8d36cb5748js\">var myChart = echarts.init(document.getElementById(\"0e79a8c848\"));\n    option = {\n        tooltip: {\n            trigger: \'item\',\n            formatter: \"{a} <br/>{b}: {c} ({d}%)\"\n        }\n        ,\n        legend: {\n            orient: \'vertical\',\n            x : \'right\',\n            y:\'center\',\n            left:\'60%\',\n            // data:[\'非常严重\',\'严重\',\'一般\']\n            data:[\'无告警\']\n        }\n        ,\n        //color:[\'#d97a80\',\'#fec400\',\'#29cc97\'],\n        color:[\'#cfcfcf\'],\n        series: [\n            {\n                name:\'告警\',\n                type:\'pie\',\n                center: [\'30%\', \'50%\'],\n                radius: [\'60%\', \'100%\'],\n                hoverAnimation: false,\n                legendHoverLink:false,\n                avoidLabelOverlap: false,\n                label: {\n                    normal: {\n                        show: false,\n                        position: \'center\'\n                    }\n                    ,\n                    emphasis: {\n                        show: true,\n                        textStyle: {\n                            fontSize: \'14\',\n                            fontWeight: \'bold\'\n                        }\n                    }\n                }\n                ,\n                labelLine: {\n                    normal: {\n                        show: false\n                    }\n                }\n                ,\n                /*data:[\n                    {value:1, name:\'非常严重\'},\n                    {value:2, name:\'严重\'},\n                    {value:17, name:\'一般\'}\n                ]*/\n                data:[\n                    {value:20, name:\'无告警\'}\n                ]\n            }\n        ]\n    };\n    if($(window).width() < 991) {\n        option.series[0].radius = [\'50%\', \'70%\'];\n    }\n    else{\n        option.series[0].radius = [\'60%\', \'100%\'];\n    }\n    $(window).resize(function() {\n            if($(window).width() < 991) {\n                option.series[0].radius = [\'50%\', \'70%\'];\n            }\n            else{\n                option.series[0].radius = [\'60%\', \'100%\'];\n            }\n            myChart.setOption(option);\n        }\n    );\n    myChart.setOption(option);\n    window.onresize = function(){\n        myChart.resize();\n    }</script>\r\n<script id=\"73d8117948js\">$.ajax({\n  url: \"/security/rest/tenant/cnt\",\n  type: \"GET\",\n  success: function (data) {\n    $(\"#tenantNum\").text(data);\n  }\n}\n      )\n</script>\r\n<script id=\"6a6c9cab48js\">$.ajax({\n  url: \"/security/rest/user/cnt\",\n  type: \"GET\",\n  success: function (data) {\n    $(\"#userNum\").text(data);\n  }\n}\n      )\n</script>\r\n<script id=\"f981082948js\">$.ajax({\n  url: $webpath + \"/bcos/v1/appModel/countsByProject?projectId=\",\n  type: \'GET\',\n  contentType: \"application/json\",\n  dataType: \"json\",\n  success: function (data) {\n  $(\'#productNum\').html(data);\n}\n       }\n      );\n// $(\'#productNum\').parent().attr(\'href\',$webpath+\'/product/page\');\n$(\'#productNum\').parent().on(\'click\',function () {\n  window.location.href = $webpath+\'/application/manage\';\n  window.parent.bcloudPathNavigation.titlePath = [];\n}\n                            );\n</script>\r\n<script id=\"77d6a77b48js\">var serviceNum = 0;\n$.ajax({\n	url: $webpath + \"/bcos/v1/app/service/count\",\n	type: \'GET\',\n	async: false,\n	success: function (msg) {\n		var count = msg.data;\n		if (msg.code == \"200\") {\n			serviceNum += count.ctn;\n		}\n	}\n});\n$.ajax({\n	url: $webpath + \"/bcos/v1/component/service/caseCountsByTenant\",\n	type: \'GET\',\n	async: false,\n	success: function (data) {\n		if (data) {\n			serviceNum += data.count;\n		}\n	}\n})\n$(\"#serviceNum\").text(serviceNum);\n\n// $(\'#serviceNum\').parent().attr(\'href\',$webpath+\'/bcos/v1/app/service/servicePage\');\n//$(\'#serviceNum\').parent().on(\'click\',function () {\n//  window.location.href = $webpath+\'/bcos/v1/app/service/servicePage\';\n// window.parent.bcloudPathNavigation.titlePath = [];\n//}\n//                           );\n</script>\r\n<script id=\"7c34e5e948js\">$.ajax({\n  url: $webpath+\"/propconfig/specification/version\",\n  type: \'GET\',\n  dataType: \"json\",\n  contentType: \'application/json\',\n  success: function (res) {\n  if(res.code === 200) {\n  $(\'#footer-version .footer-version-info\').html(res.data);\n}\n       }\n       }\n      );\n</script>\r\n<script id=\"3fcc632848js\">$(\"#quotaSeebtn\").click(function () {\n  window.location.href = $webpath + \"/product/adminQuataPage\";\n  window.parent.bcloudPathNavigation.titlePath = [];\n}\n                       );\n$.ajax({\n  url: $webpath+\"/resource/tenants\",\n  type: \'GET\',\n  success: function(data){\n  if(data) {\n  var usedCpuPer = \"0%\";\n  var usedMemoryPer = \"0%\";\n  var usedStoragePer = \"0%\";\n  cpu=data.allQuota.CPU;\n  usedCpu=data.usedQuota.CPU;\n  storage=data.allQuota.Storage;\n  usedStorage=data.usedQuota.Storage;\n  memory=data.allQuota.Memory;\n  usedMemory=data.usedQuota.Memory;\n  if (usedCpu / cpu * 100) {\n  usedCpuPer = (usedCpu / cpu * 100).toFixed(2) + \"%\";\n}\n       if (usedMemory / memory * 100) {\n  usedMemoryPer = (usedMemory / memory * 100).toFixed(2) + \"%\";\n}\nif (usedStorage / storage * 100) {\n  usedStoragePer = (usedStorage / storage * 100).toFixed(2) + \"%\";\n}\n//$(\"#cpu\").attr(\"aria-valuemax\",cpu);\n//$(\"#cpu\").attr(\"aria-valuenow\",usedCpu);\n//$(\"#cpu\").text(usedCpuPer);\n//$(\"#cpu\").css(\"width\",usedCpuPer);\n//$(\"#allCpu\").text(cpu);\n//$(\"#usedCpu\").text(usedCpu);\n//$(\"#memory\").attr(\"aria-valuemax\",memory);\n//$(\"#memory\").attr(\"aria-valuenow\",usedMemory);\n//$(\"#memory\").text(usedMemoryPer);\n//$(\"#memory\").css(\"width\",usedMemoryPer);\n//$(\"#allMemory\").text(memory);\n//$(\"#usedMemory\").text(usedMemory);\n//$(\"#storage\").attr(\"aria-valuemax\",storage);\n//$(\"#storage\").attr(\"aria-valuenow\",usedStorage);\n//$(\"#storage\").text(usedStoragePer);\n//$(\"#storage\").css(\"width\",usedStoragePer);\n//$(\"#allStorage\").text(storage);\n//$(\"#usedStorage\").text(usedStorage);\n//cpu\n$(\".process-cpu\").find(\".progress-bar\").attr(\"aria-valuemax\", data.cpu);\n$(\".process-cpu\").find(\".progress-bar\").attr(\"aria-valuenow\", data.usedCpu);\n$(\".process-cpu\").find(\".progress-bar\").css(\"width\", usedCpuPer);\n$(\".process-cpu\").find(\".percent_number\").text(usedCpuPer);\n$(\".process-cpu\").find(\".item-value .text\").text(usedCpu + \"/\" + cpu);\n//storage\n$(\".process-storage\").find(\".progress-bar\").attr(\"aria-valuemax\", data.storage);\n$(\".process-storage\").find(\".progress-bar\").attr(\"aria-valuenow\", data.usedStorage);\n$(\".process-storage\").find(\".progress-bar\").css(\"width\", usedStoragePer);\n$(\".process-storage\").find(\".percent_number\").text(usedStoragePer);\n$(\".process-storage\").find(\".item-value .text\").text(usedStorage + \"/\" + storage);\n//memory\n$(\".process-memory\").find(\".progress-bar\").attr(\"aria-valuemax\", data.memory);\n$(\".process-memory\").find(\".progress-bar\").attr(\"aria-valuenow\", data.usedMemory);\n$(\".process-memory\").find(\".progress-bar\").css(\"width\", usedMemoryPer);\n$(\".process-memory\").find(\".percent_number\").text(usedMemoryPer);\n$(\".process-memory\").find(\".item-value .text\").text(usedMemory + \"/\" + memory);\n}\n}\n}\n)\n</script>\r\n', '新首页(平台管理者)12.12', '0', '<style id=\"ee26061f48cs\">.content-show-top .panel.panel-default{\n  height:216px;\n}</style>\r\n<style id=\"32864e0548cs\">.v-announcement {\n  width: 100%;\n  height: 30px;\n  background-color: rgba(242, 242, 242, 1);\n  text-align: center;\n  line-height: 30px;\n}\n.give-an-alarm .panel-body{\n  padding-top: 0;\n}\n</style>\r\n<style id=\"4b0c004348cs\">.fixed-table-body{\n  height:auto !important;\n}\n</style>\r\n<style id=\"9ecece1e48cs\">.v-notifications {\n  white-space: nowrap;\n  overflow: hidden;\n  text-overflow: ellipsis;\n  font-family: \'ArialMT\', \'Arial\';\n}\n.post_module.panel.panel-default{\n  border-bottom:1px solid #e4e4e4 !important;\n}\n.post_module .panel-heading:before{\n  content: \'\';\n  display:inline-block;\n  background: url(\'../../../theme/default/img/pageModel/content_sprite_01.png\') 0 0 no-repeat;\n  width: 20px;\n  height: 18px;\n  margin-right: 10px;\n  vertical-align: text-bottom;\n}\n.post_module .panel-body{\n  padding: 15px 8px;\n}\n.post_module .panel-body .post_module_item{\n  border-left:1px solid #ebebeb;\n  padding-left: 5px;\n}\n.post_module .v-notification{\n  white-space: nowrap;\n  overflow: hidden;\n  text-overflow: ellipsis;\n  height: 40px;\n  width:100%;\n  position: relative;\n  top: -21px;\n}\n.post_module_title{\n  padding-left:20px;\n  color:#333333;\n}\n.post_module_title>span{\n  color:#4d4d4d;\n}\n.post_module_title>a,.post_module_title>a:hover,.post_module_title>a:focus{\n  color:#333333;\n  text-decoration: none;\n  cursor:pointer;\n}\n.post_module_time{\n  display:block;\n  padding-left:20px;\n  color:#737373;\n}\n.post_modul