INSERT INTO `page_model` VALUES ('3ac7421eb97c11e9986a1402ec7d7650', 'admin', '2019-07-09 14:24:02', 'tenant_system', 'admin', '2019-07-12 14:42:04', '<script id=\"a400cd0348js\">// 查询项目表\ninitProjectGlyph();\nfunction initProjectGlyph() {\n  $.ajax({\n    url: $webpath+\'/console/v1/project/allProProject\',\n    method: \'POST\',\n    contentType: \"application/json;charset=utf-8\",\n    dataType: \"json\",\n    data:JSON.stringify({\n    \"pageNo\": 1,\n    \"pageSize\": 10000\n  }\n        ),\n    success: function (result) {\n      if(result.code===0){\n        var html = \"\";\n        if(result.data.data.length>0){\n          // 有项目\n          var proNum = 0;\n          $.each(result.data.data,function (index,item) {\n            /*获取每个项目的成员数*/\n            $.ajax({\n              url:$webpath+\"/console/v1/project/selectAllUsers\",\n              type:\"GET\",\n              async: false,\n              contentType:\"application/json; charset=utf-8\",\n              dataType:\"json\",\n              data: {\n              \"projectId\": item.projectId\n            }\n                   ,\n                   success: function (result) {\n              if(result.code === 0){\n                proNum = result.data.length;\n              }\n            }\n          }\n                );\n          var projectIcon = item.profile ? item.profile : \'profile1\';\n          html += \'<a class=\"card-item-container col-xs-12 col-sm-6 col-md-3 col-lg-3\" href=\"javascript:;\" onclick=\"goToDashboard(\\\'\'+item.projectId+\'\\\',\\\'\'+item.projectName+\'\\\')\">\\n\' +\n            \'                <div class=\"card-item\">\\n\' +\n              \'                    <div class=\"project-item-top ellipsis\">\\n\' +\n                \'                        <img src=\"\'+$resContextPath+\'/img/bcm/project/\'+projectIcon+\'.png\" alt=\"\">\\n\' +\n                  \'                        <span>\'+item.projectName+\'</span>\\n\' +\n                    \'                    </div>\\n\' +\n                      \'                    <div class=\"project-item-bottom\">\\n\' +\n                        \'                        <span>创建人\'+item.createUser+\'</span>\\n\' +\n                          \'                        <span>成员\'+proNum+\'个</span>\\n\' +\n                            \'                        <p class=\"mult_line_ellipsis\">\'+item.projectResume+\'</p>\\n\' +\n                              \'                        <span class=\"project-new-time\">\'+timestampToTime(item.createTime)+\'</span>\\n\' +\n                                \'                    </div>\\n\' +\n                                  \'                </div>\\n\' +\n                                    \'            </a>\';\n        }\n        );\n        $(\'#projectCardList\').html(html);\n        $(\'#hasProjectShow\').show();\n        $(\'#noProjectShow\').hide();\n      }\n      else {\n        // 无项目\n        $(\'#hasProjectShow\').hide();\n        $(\'#noProjectShow\').show();\n        $(\'#noProjectShow img.no-project-img\').attr(\'src\',$resContextPath+\'/img/bcm/project/no_project.png\')\n        //$(\'#noProjectShow img.no-project-img\').attr(\'src\',$resContextPath+\'/img/model/console/bcm/project/no_project.png\')\n      }\n    }\n}\n}\n);\n}\n// 跳转项目dashboard\nfunction goToDashboard(projectId,projectName) {\n  $.ajax({\n    url:$webpath+\"/console/v1/project/setId?projectId=\"+projectId,\n    type:\"GET\",\n    contentType:\"application/json;charset=utf-8\",\n    dataType: \"json\",\n    success: function (result) {\n    if(result.code === 0){\n    $(\"#top_area1\",window.parent.document).find(\'.nav-left-project .dropdown-toggle>span\').html(projectName);\n    window.location.href = $webpath + \"/v1/pageModel/pageTemplate/ed14c73bfe7811e8ad011402ec81c25c?projectId=\" + projectId;\n  }\n         }\n         }\n        );\n}\n//时间戳转换\nfunction timestampToTime(timestamp) {\n  var date = new Date(timestamp);\n  //时间戳为10位需*1000，时间戳为13位的话不需乘1000\n  Y = date.getFullYear() + \'-\';\n  M = (date.getMonth()+1 < 10 ? \'0\'+(date.getMonth()+1) : date.getMonth()+1) + \'-\';\n  D = (date.getDate() < 10 ? \'0\'+date.getDate() : date.getDate()) + \' \';\n  h = (date.getHours() < 10 ? \'0\'+date.getHours() : date.getHours()) + \':\';\n  m = (date.getMinutes() < 10 ? \'0\'+date.getMinutes() : date.getMinutes()) + \':\';\n  s = (date.getSeconds() < 10 ? \'0\'+date.getSeconds() : date.getSeconds());\n  return Y+M+D+h+m+s;\n}\n// 调用门户的新增项目方法\nfunction toCreateProject() {\n  window.parent.openAddProjectModal();\n}\n</script>\r\n<script id=\"3799095848js\">$.ajax({\n  url: $webpath+\"/propconfig/specification/version\",\n  type: \'GET\',\n  dataType: \"json\",\n  contentType: \'application/json\',\n  success: function (res) {\n  if(res.code === 200) {\n  $(\'#footer-version .footer-version-info\').html(res.data);\n}\n       }\n       }\n      );\n</script>\r\n', '新首页（用户）7.9', '0', '<style id=\"a400cd0348cs\">.page-container {\n  padding: 25px 0;\n}\n.row {\n  margin-right: 0px;\n  margin-left: 0px;\n}\n.col-lg-1, .col-lg-10, .col-lg-11, .col-lg-12, .col-lg-2, .col-lg-3,\n.col-lg-4, .col-lg-5, .col-lg-6, .col-lg-7, .col-lg-8, .col-lg-9,\n.col-md-1, .col-md-10, .col-md-11, .col-md-12, .col-md-2, .col-md-3,\n.col-md-4, .col-md-5, .col-md-6, .col-md-7, .col-md-8, .col-md-9{\n  padding-right:0px;\n  padding-left: 0px;\n}\na:link, a:visited, a:hover, a:active {\n  text-decoration: none;\n}\n/*有项目*/\n.card-item-container{\n  padding: 15px;\n  float: left;\n}\n.card-item {\n  width: 100%;\n  transition: 0.3s;\n  cursor: pointer;\n  background-color: #ffffff;\n  border: solid 1px #ffffff;\n  padding: 15px 22px;\n}\n.card-item:hover{\n  background-color: #fbfbfc;\n  border: solid 1px #d9d9d9;\n}\n.project-item-top {\n  height: 32px;\n  line-height: 32px;\n}\n.project-item-top img{\n  width: 32px;\n  height: 32px;\n  margin-right: 14px;\n  float: left;\n}\n.project-item-top span{\n  font-size: 16px;\n  color: #333333;\n}\n.project-item-bottom {\n  text-align: left;\n  height: 168px;\n  font-size: 14px;\n  /*position: relative;*/\n}\n.project-item-bottom span {\n  color: #999999;\n  display: block;\n  margin-bottom: 10px;\n}\n.project-item-bottom span.project-new-time{\n  /*position: absolute;\n  bottom: 0;*/\n  padding-top: 20px;\n}\n.project-item-bottom p{\n  color: #333333;\n  width: 100%;\n  height: 60px;\n}\n.mult_line_ellipsis {\n  overflow: hidden;\n  text-overflow: ellipsis;\n  display: -webkit-box;\n  -webkit-line-clamp: 3;\n  -webkit-box-orient: vertical;\n}\n/*无项目*/\n#noProjectShow{\n  text-align: center;\n  color: #333333;\n  font-size: 14px;\n  top: 50%;\n  position: absolute;\n  margin-top: -140px;\n  width: calc(100% - 30px);\n}\n.no-project-content{\n  margin: 0 auto;\n  width: 240px;\n}\nimg.no-project-img{\n  margin-bottom: 29px;\n}\n.no-project-tip span{\n  font-size: 14px;\n  color: #333333;\n  display: block;\n  margin-bottom: 10px;\n}\n</style>\r\n<style id=\"3799095848cs\">#footer-version {\n  color: #999999;\n  font-family: MicrosoftYaHei;\n  font-size: 12px;\n  padding-top: 30px;\n  text-align: center;\n  position: fixed;\n  bottom: 0;\n  width: 100%;\n  padding-bottom: 20px;\n}\n</style>\r\n', '<div class=\"innerDrag force drag\" data-uuid=\"a400cd0348\" data-moduleres=\"\">\n  <div class=\"v-toolBar\">\n    <a href=\"#\">\n      <i class=\"glyphicon glyphicon-move\">\n      </i>\n      &nbsp;    \n    </a>\n    <a href=\"#\">\n      <i class=\"glyphicon glyphicon-trash\">\n      </i>\n      &nbsp;    \n    </a>\n    <a href=\"#\">\n      <i class=\"glyphicon glyphicon-edit\">\n      </i>\n      &nbsp;    \n    </a>\n  </div>\n  <div class=\"row row-fluid\" data-uuid=\"fa1b5dee48\">\n    <div class=\"col-md-12 column force drop-helper\" data-uuid=\"8203046448\" style=\"position: unset;\">\n      <div class=\"page-container\" id=\"hasProjectShow\">\n        <div id=\"projectCardList\" class=\"row\" style=\"margin: -15px -15px 0 -15px;\">\n        </div>\n      </div>\n      <div id=\"noProjectShow\" style=\"display: none\">\n        <div class=\"no-project-content\">\n          <img class=\"no-project-img\" src=\"\" alt=\"\">\n          <div class=\"no-project-tip\">\n            <span style=\"font-size: 24px;margin-bottom: 23px\">\n              没有归属项目，您可以\n            </span>\n            <span>\n              点击此处\n              <a href=\"javascript:;\" onclick=\"toCreateProject()\">\n                创建项目\n              </a>\n            </span>\n            <span>\n              联系租户管理员为您添加项目\n            </span>\n          </div>\n        </div>\n      </div>\n    </div>\n  </div>\n</div><div class=\"innerDrag force drag\" data-uuid=\"3799095848\" data-moduleres=\"\">\n  <div class=\"v-toolBar\">\n    <a href=\"#\">\n      <i class=\"glyphicon glyphicon-move\">\n      </i>\n      &nbsp;    \n    </a>\n    <a href=\"#\">\n      <i class=\"glyphicon glyphicon-trash\">\n      </i>\n      &nbsp;    \n    </a>\n    <a href=\"#\">\n      <i class=\"glyphicon glyphicon-edit\">\n      </i>\n      &nbsp;    \n    </a>\n  </div>\n  <div class=\"row row-fluid\" data-uuid=\"20bc2af948\" id=\"footer-version\">\n    <div class=\"col-md-12 column force drop-helper\" data-uuid=\"c86e611048\">\n      BONC Cloud Operating System \n      <span class=\"footer-version-info\">\n      </span> &nbsp;版权所有 2019 BONC 保留所有权利\n    </div>\n  </div>\n</div>', 'root', '<div class=\"innerDrag force \" data-moduleres=\"\">\n  <div class=\"v-toolBar\">\n    <a href=\"#\" class=\"\">\n      <i class=\"glyphicon glyphicon-move\">\n      </i>\n      &nbsp;    \n    </a>\n    <a href=\"#\" class=\"\">\n      <i class=\"glyphicon glyphicon-trash\">\n      </i>\n      &nbsp;    \n    </a>\n    <a href=\"#\" class=\"\">\n      <i class=\"glyphicon glyphicon-edit\">\n      </i>\n      &nbsp;    \n    </a>\n  </div>\n  <div class=\"row row-fluid\">\n    <div class=\"col-md-12 column force drop-helper\" style=\"position: unset;\">\n      <div class=\"page-container\" id=\"hasProjectShow\">\n        <div id=\"projectCardList\" class=\"row\" style=\"margin: -15px -15px 0 -15px;\">\n        </div>\n      </div>\n      <div id=\"noProjectShow\" style=\"display: none\" class=\"\">\n        <div class=\"no-project-content\">\n          <img class=\"no-project-img\" src=\"\" alt=\"\">\n          <div class=\"no-project-tip\">\n            <span style=\"font-size: 24px;margin-bottom: 23px\" class=\"\">\n              没有归属项目，您可以\n            </span>\n            <span class=\"\">\n              点击此处\n              <a href=\"javascript:;\" onclick=\"toCreateProject()\" class=\"\">\n                创建项目\n              </a>\n            </span>\n            <span class=\"\">\n              联系租户管理员为您添加项目\n            </span>\n          </div>\n        </div>\n      </div>\n    </div>\n  </div>\n</div><div class=\"innerDrag force \" data-moduleres=\"\">\n  <div class=\"v-toolBar\">\n    <a href=\"#\" class=\"\">\n      <i class=\"glyphicon glyphicon-move\">\n      </i>\n      &nbsp;    \n    </a>\n    <a href=\"#\" class=\"\">\n      <i class=\"glyphicon glyphicon-trash\">\n      </i>\n      &nbsp;    \n    </a>\n    <a href=\"#\" class=\"\">\n      <i class=\"glyphicon glyphicon-edit\">\n      </i>\n      &nbsp;    \n    </a>\n  </div>\n  <div class=\"row row-fluid\" id=\"footer-version\">\n    <div class=\"col-md-12 column force drop-helper\">\n      BONC Cloud Operating System \n      <span class=\"footer-version-info\">\n      </span> &nbsp;版权所有 2019 BONC 保留所有权利\n    </div>\n  </div>\n</div>\n');
