INSERT INTO `page_model` VALUES ('5e12c5788e8111e9ab651402ec7d7650', 'admin', '2019-06-14 16:49:30', 'tenant_system', 'admin', '2019-06-25 19:04:40', '<script type=\"text/javascript\" id=\"809544c8739011e88b091402ec8b0a88\" data-count=\"0\" src=\"../../../v1/pageRes/res/file/809544c8739011e88b091402ec8b0a88\"></script>\r\n<script type=\"text/javascript\" id=\"bc4bde84aff611e88b091402ec8b0a88\" data-count=\"0\" src=\"../../../v1/pageRes/res/file/bc4bde84aff611e88b091402ec8b0a88\"></script>\r\n<script type=\"text/javascript\" id=\"3c2cf2bfedfa11e8a7821402ec81c25c\" data-count=\"0\" src=\"../../../v1/pageRes/res/file/3c2cf2bfedfa11e8a7821402ec81c25c\"></script>\r\n<script id=\"8d36cb5748js\">var myChart = echarts.init(document.getElementById(\"0e79a8c848\"));\noption = {\n  tooltip: {\n    trigger: \'item\',\n    formatter: \"{a} <br/>{b}: {c} ({d}%)\"\n  }\n  ,\n  legend: {\n    orient: \'vertical\',\n    x : \'right\',\n    y:\'center\',\n    left:\'60%\',\n    data:[\'非常严重\',\'严重\',\'一般\']\n  }\n  ,\n  color:[\'#d97a80\',\'#fec400\',\'#29cc97\'],\n  series: [\n    {\n      name:\'告警\',\n      type:\'pie\',\n      center: [\'30%\', \'50%\'],\n      radius: [\'60%\', \'100%\'],\n      hoverAnimation: false,\n      legendHoverLink:false,\n      avoidLabelOverlap: false,\n      label: {\n        normal: {\n          show: false,\n          position: \'center\'\n        }\n        ,\n        emphasis: {\n          show: true,\n          textStyle: {\n            fontSize: \'14\',\n            fontWeight: \'bold\'\n          }\n        }\n      }\n      ,\n      labelLine: {\n        normal: {\n          show: false\n        }\n      }\n      ,\n      data:[\n        {\n          value:1, name:\'非常严重\'}\n        ,\n        {\n          value:2, name:\'严重\'}\n        ,\n        {\n          value:17, name:\'一般\'}\n      ]\n    }\n  ]\n};\nif($(window).width() < 991) {\n  option.series[0].radius = [\'50%\', \'70%\'];\n}\nelse{\n  option.series[0].radius = [\'60%\', \'100%\'];\n}\n$(window).resize(function() {\n  if($(window).width() < 991) {\n    option.series[0].radius = [\'50%\', \'70%\'];\n  }\n  else{\n    option.series[0].radius = [\'60%\', \'100%\'];\n  }\n  myChart.setOption(option);\n}\n                );\nmyChart.setOption(option);\nwindow.onresize = function(){\n  myChart.resize();\n}\n</script>\r\n<script id=\"9ecece1e48js\">$.ajax({\n  url: \"/portal/rest/message/querySysMsgInfo\",\n  type: \"GET\",\n  success: function (data) {\n    var str=\'\';\n    if(data.data && data.data.length> 0) {\n      $(data.data.slice(0,4)).each(function(index,item){\n        //str+=\'<p class=\"v-notifications\">【公告】<a href=\"/portal/announcement!list.action?onlyshow=true\">\'+item.msgTitle+\'</a></p>\';\n        str+=\'<span class=\"round-icon-point\"></span>\\n\' +\n          \'<p class=\"v-notification\">\\n\' +\n            \'    <span class=\"post_module_title\">\\n\' +\n              \'        <span>公告 | </span>\\n\' +\n                \'        <a href=\"/portal/message!listSysMsg.action\">\' + item.msgTitle+\'</a>\\n\' +\n                  \'    </span>\\n\' +\n                    \'    <span class=\"post_module_time\">\'+item.sendTime+\'</span>\\n\' +\n                      \'</p>\';\n      }\n                                  )\n      str+=\'<span class=\"round-icon-point look-all-icon\">\\n\' +\n        \'        </span>\\n\' +\n          \'        <p class=\"look-all-help\">\\n\' +\n            \'          <a href=\"/portal/message!listSysMsg.action\">查看全部  &gt;&gt;</a>\\n\' +\n              \'        </p>\';\n      $(\"#announcement .post_module_item\").html(str);\n      $(\'.post_module .v-notification\').eq(0).css(\'top\',\'-28px\');\n    }\n  }\n}\n      )\n</script>\r\n<script id=\"6a6c9cab48js\">var userNum = 0;\n$.ajax({\n  type: \"GET\",\n  url: $webpath + \"/user/findCurUser\",\n  dataType: \"json\",\n  async: false,\n  success: function (data) {\n  tenantId = data.tenantId;\n  $.ajax({\n  url: \"/security/rest/user/list?tenant_id=\" + tenantId,\n  type: \'GET\',\n  async: false,\n  success: function (data) {\n  if(data){\n  console.log(data.length)\n  userNum+=data.length;\n}\n       }\n       }\n      )\n}\n}\n);\n$(\"#userNum\").text(userNum);\n$(\'#userNum\').parent().attr(\'href\',\'/security/userinfo!list.action\');\n</script>\r\n<script id=\"f981082948js\">$.ajax({\n  url: $webpath+\"/console/v1/project/activeProProject\",\n  type: \'POST\',\n  contentType: \"application/json\",\n  data: JSON.stringify({\n  pageNo: 1, pageSize: 1000}\n      ),\n  success: function (msg) {\n    var projectNum = \"0\";\n    var count = msg.data;\n    if(msg.code == \"0\"){\n      projectNum = count.total;\n    }\n    $(\"#projectNum\").text(projectNum);\n  }\n}\n);\n// $(\'#projectNum\').parent().attr(\'href\',$webpath+\'/console/v1/project/\');\n$(\'#projectNum\').parent().on(\'click\',function () {\n    window.location.href = $webpath+\'/console/v1/project/\';\n    window.parent.bcloudPathNavigation.titlePath = [];\n});\n</script>\r\n<script id=\"73d8117948js\">var serviceNum = 0;\n$.ajax({\n  url: $webpath+\"/bcos/v1/app/service/count\",\n  type: \'GET\',\n  async: false,\n  success: function (msg) {\n  var count = msg.data;\n  if(msg.code == \"200\"){\n  serviceNum += count.ctn;\n}\n       }\n       }\n      );\n$.ajax({\n  type: \"GET\",\n  url: $webpath + \"/user/findCurUser\",\n  dataType: \"json\",\n  async: false,\n  success: function (data) {\n  tenantId = data.tenantId;\n  $.ajax({\n  url: $webpath + \"/bcos/v1/component/service/caseCountsByTenant?tenantId=\" + tenantId,\n  type: \'GET\',\n  async: false,\n  success: function (data) {\n  if(data){\n  serviceNum+=data.count;\n}\n       }\n       }\n      )\n}\n}\n);\n$(\"#serviceNum\").text(serviceNum);\n// $(\'#serviceNum\').parent().attr(\'href\',$webpath+\'/bcos/v1/app/service/servicePage\');\n$(\'#serviceNum\').parent().on(\'click\',function () {\n    window.location.href = $webpath+\'/bcos/v1/app/service/servicePage\';\n    wind