INSERT INTO `page_model` VALUES ('8edd3fe5bcab11e9986a1402ec7d7650', 'admin', '2018-12-12 16:26:14', 'tenant_system', 'admin', '2019-08-08 16:39:49', '<script type=\"text/javascript\" id=\"809544c8739011e88b091402ec8b0a88\" data-count=\"0\" src=\"../../../v1/pageRes/res/file/809544c8739011e88b091402ec8b0a88\"></script>\r\n<script type=\"text/javascript\" id=\"bc4bde84aff611e88b091402ec8b0a88\" data-count=\"0\" src=\"../../../v1/pageRes/res/file/bc4bde84aff611e88b091402ec8b0a88\"></script>\r\n<script type=\"text/javascript\" id=\"3c2cf2bfedfa11e8a7821402ec81c25c\" data-count=\"0\" src=\"../../../v1/pageRes/res/file/3c2cf2bfedfa11e8a7821402ec81c25c\"></script>\r\n<script id=\"9ecece1e48js\">$.ajax({\n  url: \"/portal/rest/message/querySysMsgInfo\",\n  type: \"GET\",\n  success: function (data) {\n    var str=\'\';\n    if(data.data && data.data.length> 0) {\n      $(data.data.slice(0,4)).each(function(index,item){\n        //str+=\'<p class=\"v-notifications\">【公告】<a href=\"/portal/announcement!list.action?onlyshow=true\">\'+item.msgTitle+\'</a></p>\';\n        str+=\'<span class=\"round-icon-point\"></span>\\n\' +\n          \'<p class=\"v-notification\">\\n\' +\n            \'    <span class=\"post_module_title\">\\n\' +\n              \'        <span>公告 | </span>\\n\' +\n                \'        <a href=\"/portal/message!listSysMsg.action\">\' + item.msgTitle+\'</a>\\n\' +\n                  \'    </span>\\n\' +\n                    \'    <span class=\"post_module_time\">\'+item.sendTime+\'</span>\\n\' +\n                      \'</p>\';\n      }\n                                  )\n      str+=\'<span class=\"round-icon-point look-all-icon\">\\n\' +\n        \'        </span>\\n\' +\n          \'        <p class=\"look-all-help\">\\n\' +\n            \'          <a href=\"/portal/message!listSysMsg.action\">查看全部  &gt;&gt;</a>\\n\' +\n              \'        </p>\';\n      $(\"#announcement .post_module_item\").html(str);\n      $(\'.post_module .v-notification\').eq(0).css(\'top\',\'-28px\');\n    }\n  }\n}\n      )\n</script>\r\n<script id=\"77d6a77b48js\">var serviceNum = 0;\n$.ajax({\n	url: $webpath + \"/bcos/v1/app/service/count\",\n	type: \'GET\',\n	async: false,\n	success: function (msg) {\n		var count = msg.data;\n		if (msg.code == \"200\") {\n			serviceNum += count.ctn;\n		}\n	}\n});\n$.ajax({\n	url: $webpath + \"/bcos/v1/component/service/caseCountsByTenant\",\n	type: \'GET\',\n	async: false,\n	success: function (data) {\n		if (data) {\n			serviceNum += data.count;\n		}\n	}\n})\n$(\"#serviceNum\").text(serviceNum);\n\n// $(\'#serviceNum\').parent().attr(\'href\',$webpath+\'/bcos/v1/app/service/servicePage\');\n//$(\'#serviceNum\').parent().on(\'click\',function () {\n//  window.location.href = $webpath+\'/bcos/v1/app/service/servicePage\';\n// window.parent.bcloudPathNavigation.titlePath = [];\n//}\n//                           );\n</script>\r\n<script id=\"7c34e5e948js\">$.ajax({\n  url: $webpath+\"/propconfig/specification/version\",\n  type: \'GET\',\n  dataType: \"json\",\n  contentType: \'application/json\',\n  success: function (res) {\n  if(res.code === 200) {\n  $(\'#footer-version .footer-version-info\').html(res.data);\n}\n       }\n       }\n      );\n</script>\r\n<script id=\"73d8117948js\">$.ajax({\n  url: \"/security/rest/tenant/cnt\",\n  type: \"GET\",\n  success: function (data) {\n    $(\"#tenantNum\").text(data);\n  }\n}\n      )\n</script>\r\n<script id=\"f981082948js\">$.ajax({\n  url: $webpath + \"/bcos/v1/appModel/countsByProject?projectId=\",\n  type: \'GET\',\n  contentType: \"application/json\",\n  dataType: \"json\",\n  success: function (data) {\n  $(\'#productNum\').html(data);\n}\n       }\n      );\n// $(\'#productNum\').parent().attr(\'href\',$webpath+\'/product/page\');\n$(\'#productNum\').parent().on(\'click\',function () {\n  window.location.href = $webpath+\'/application/manage\';\n  window.parent.bcloudPathNavigation.titlePath = [];\n}\n                            );\n</script>\r\n<script id=\"9de804a648js\">function getProductTable(productTypeId) {\n  $(\".productTable\").bootstrapTable({\n    url: $webpath + \"/bcos/v1/component/service/caseCountsByProduct\",\n    method: \"GET\",\n    contentType: \"application/json\",\n    dataType: \"json\",\n    classes: \'table-no-bordered\',\n    cache: false,\n    striped: false,\n    pagination: false,\n    pageNumber: 1,\n    pageSize: 100,\n    pageList: [10, 25, 50, 100],\n    paginationDetailHAlign: \'left\',\n    showJumpto: true,\n    paginationPreText: \'<i class=\"fa fa-angle-left bconsole-left-arrow\" aria-hidden=\"true\"></i>\',\n    paginationNextText: \'<i class=\"fa fa-angle-right bconsole-left-arrow\" aria-hidden=\"true\"></i>\',\n    formatRecordsPerPage: function (pageNumber) {\n    // return \'每页显示 \' + pageNumber + \' 条记录\';\n    return \'\' + pageNumber + \'\';\n  }\n                                    ,\n                                    formatShowingRows: function (pageFrom, pageTo, totalRows) {\n    // return \'显示第 \' + pageFrom + \' 到第 \' + pageTo + \' 条记录，总共 \' + totalRows + \' 条记录\';\n    return \'共\' + totalRows + \'条\';\n  }\n  ,\n    queryParams: function (params) {\n      // return JSON.stringify({\n      // 	\"page\": {\n      // 		\"pageNo\": (params.offset / params.limit) + 1,\n      // 		\"pageSize\": 10\n      // 	},\n      // 	\"dataAuth\": \"00\",\n      // 	\"product\": {\n      // 		\"productStatus\": \"30\",\n      // 		\"productTypeId\": productTypeId ? productTypeId : \'\',\n      // 		\"productName\": $(\'#productNameInput\').val()\n      // 	}\n      // })\n    }\n  ,\n    queryParamsType: \'limit\',\n      responseHandler: function (res) {\n        loadProductBoxs(res);\n        return {\n          \"total\": Object.keys(res).length,\n          \"rows\": res\n        }\n      }\n  ,\n    sidePagination: \"server\",\n      clickToSelect: true,\n        uniqueId: \"productId\",\n          columns: [\n            // 	{\n            // 	field: \'productName\',\n            // 	title: \'服务名称\',\n            // 	align: \'center\',\n            // 	valign: \'middle\',\n            // 	formatter: function (value, row, index) {\n            // 		return \'<a href=\"javascript:;\" onclick=\"toProductApply(\\\'\' + row.productId + \'\\\',\\\'\' + row.productStatus + \'\\\')\">\'+ row.productName +\'</a>\';\n            // 	}\n            // }, {\n            // 	field: \'productId\',\n            // 	title: \'服务编码\',\n            // 	align: \'center\',\n            // 	valign: \'middle\'\n            // }, {\n            // 	field: \'productVersion\',\n            // 	title: \'版本号\',\n            // 	align: \'center\',\n            // 	valign: \'middle\'\n            // }, {\n            // 	field: \'productStatus \',\n            // 	title: \'服务状态\',\n            // 	align: \'center\',\n            // 	valign: \'middle\',\n            // 	formatter: function (value, row, index) {\n            // 		return svcStateConvert(row.productStatus);\n            // 	}\n            // }, {\n            // 	field: \'productTypeId \',\n            // 	title: \'服务类型\',\n            // 	align: \'center\',\n            // 	valign: \'middle\',\n            // 	formatter: function (value, row, index) {\n            // 		return row.productTypeName;\n            // 	}\n            // }, {\n            // 	field: \'orderType\',\n            // 	title: \'订购方式\',\n            // 	align: \'center\',\n            // 	valign: \'middle\',\n            // 	formatter: function (value, row, index) {\n            // 		for (var i = 0; i < allPorderWaysArr.length; i++) {\n            // 			if(allPorderWaysArr[i].pwaysType == row.orderType) {\n            // 				return allPorderWaysArr[i].pwaysName;\n            // 			}\n            // 		}\n            // 	}\n            // }, {\n            // 	field: \'createBy\',\n            // 	title: \'创建人\',\n            // 	align: \'center\',\n            // 	valign: \'middle\'\n            // }, {\n            // 	field: \'createDate\',\n            // 	title: \'创建时间\',\n            // 	align: \'center\',\n            // 	valign: \'middle\'\n            // }\n          ]\n}\n)\n}\n//加载boxs\nfunction loadProductBoxs(boxs) {\n  $(\".products-list\").empty();\n  if (boxs && !$.isEmptyObject(boxs)) {\n    $.each(boxs, function (key, value) {\n      var html = \'\';\n      if (value.details.productName) {\n        html += \'<a class=\"products-item-container col-xs-12 col-sm-6 col-md-3 col-lg-3\" title=\"单击\" href=\"\' + $webpath + \'/productCase/component/service?productId=\' + value.details.productId + \'\" onclick=\"window.parent.bcloudPathNavigation.titlePath = [];\">\';\n      }\n      else {\n        if (value.details.appType == \"2\") {\n          html += \'<a class=\"products-item-container col-xs-12 col-sm-6 col-md-3 col-lg-3\" title=\"单击\" href=\"\' + $webpath + \'/application/servflow/erteTest1?applicationId=\' + value.details.applicationId + \'\" onclick=\"window.parent.bcloudPathNavigation.titlePath = [];\">\';\n        }\n        else {\n          html += \'<a class=\"products-item-container col-xs-12 col-sm-6 col-md-3 col-lg-3\" title=\"单击\" href=\"\' + $webpath + \'/bcos/v1/app/service/servicePage?applicationId=\' + value.details.applicationId + \'\" onclick=\"window.parent.bcloudPathNavigation.titlePath = [];\">\';\n        }\n      }\n      var itemTitle = value.details.productName ? value.details.productName : value.details.appName;\n      html += \'<input type=\"text\" hidden value=\"\' + value.details.productId + \'\">\' +\n        \'		<div class=\"products-item\">\' +\n          \'			<div class=\"item-img\" id=\"product_\' + (value.details.productId ? value.details.productId : value.details.applicationId) + \'\">\' +\n            \'			</div>\' +\n              \'			<div class=\"item-text\">\' +\n                \'				<div class=\"item-title\" title=\"\' + itemTitle + \'\">\' + (value.details.productName ? value.details.productName : value.details.appName) + \'</div>\' +\n                  \'					<div class=\"item-info\">\' +\n                    \'						<p class=\"info-p\">服务数量：\' + value.count + \'</p>\' +\n                      \'					</div>\' +\n                        \'				</div>\' +\n                          \'			</div>\' +\n                            \'	</a>\';\n      $(\".products-list\").append(html);\n    }\n          )\n    //$(\".products-item-container\").click(function (e) {\n    //window.open(\'/productCase/component/service?productId=\' + $(this).find(\"input\").val());\n    //}\n    //);\n    //加载图片\n    $.each(boxs, function (key, value) {\n      if (value.details.productId) {\n        $.ajax({\n          url: $webpath + \'/console/v1/product/singleProduct/\' + value.details.productId,\n          type: \'GET\',\n          success: function (singleProduct) {\n          if (singleProduct) {\n          //       		 $(\"#product_\" + value.details.productId).find(\"img\").attr(\"src\", \"data:image/jpg;base64,\" + singleProduct.productLogo);\n          $(\"#product_\" + value.details.productId).css({\n          \"background-image\": \"url(\\\"data:image/jpg;base64,\" + singleProduct.productLogo + \"\\\")\",\n          \"background-repeat\": \"no-repeat\",\n          \"background-position\": \"center\",\n          \"background-size\": \"56px\"\n        }\n              );\n      }\n    }\n           }\n          );\n  }\n  if (value.details.applicationId) {\n    //        $(\"#product_\" + value.details.applicationId).find(\"img\").attr(\"src\", $resContextPath + \"/img/pageModel/svc-init.png\");\n    $(\"#product_\" + value.details.applicationId).css({\n      \"background-image\": \"url(\\\"\" + $resContextPath + \"/img/pageModel/svc-init.png\\\")\",\n      \"background-repeat\": \"no-repeat\",\n      \"background-position\": \"center\",\n      \"background-size\": \"56px\"\n    }\n                                                    );\n  }\n}\n)\n}\nelse {\n  $(\".products-list\").append(\'<span class=\"no-project-tips\">没有查找到相关服务</span>\');\n}\n}\ngetProductTable();\n</script>\r\n<script id=\"32864e0548js\">$(\".taskOperate\").html(\'<a href=\"\' + $webpath + \'/v1/pro/pbmOrderProcess/page\">\' +\n                       \'<img src=\"\' + $resContextPath + \'/img/common/points-gray.png\">\' +\n                       \'</a>\'\n                      );\n</script>\r\n<script id=\"6a6c9cab48js\">$.ajax({\n  url: \"/security/rest/user/cnt\",\n  type: \"GET\",\n  success: function (data) {\n    $(\"#userNum\").text(data);\n  }\n}\n      )\n</script>\r\n<script id=\"f981082940js\">$.ajax({\n  url: $webpath + \"/console/v1/project/allProProject\",\n  type: \'POST\',\n  contentType: \"application/json\",\n  data: JSON.stringify({\n  \"pageNo\": 1, \"pageSize\": 10000 }\n      ),\n  success: function (res) {\n    if (res.code == 0) {\n      $(\"#projectNum\").text(res.data.total)\n    }\n  }\n}\n)\n</script>\r\n<script id=\"46975e5f48js\">var myChart = echarts.init(document.getElementById(\"a75467e848\"));\n$.ajax({\n    url: $webpath + \'/resource/quota/nodes\',\n    type: \'GET\',\n    success: function (res) {\n        if (res.code == 200 && res.data) {\n            var health = 0;\n            var unhealth = 0;\n            if (res.data.health) {\n                health = res.data.health;\n            }\n            if (res.data.unhealth) {\n                unhealth = res.data.unhealth;\n            }\n            option = {\n                tooltip: {\n                    trigger: \'item\',\n                    formatter: \"{a} <br/>{b}: {c} ({d}%)\"\n                }\n                ,\n                legend: {\n                    orient: \'vertical\',\n                    x: \'right\',\n                    y: \'center\',\n                    left: \'60%\',\n                    // data:[\'非常严重\',\'严重\',\'一般\']\n                    data: [\'未启用节点\', \'有效节点\']\n                }\n                ,\n                //color:[\'#d97a80\',\'#fec400\',\'#29cc97\'],\n                color: [\'#cfcfcf\', \"#4dafff\"],\n                series: [\n                    {\n                        name: \'集群节点\',\n                        type: \'pie\',\n                        center: [\'30%\', \'50%\'],\n                        radius: [\'60%\', \'100%\'],\n                        hoverAnimation: false,\n                        legendHoverLink: false,\n                        avoidLabelOverlap: false,\n                        label: {\n                            normal: {\n                                show: false,\n                                position: \'center\'\n                            }\n                            ,\n                            emphasis: {\n                                show: true,\n                                textStyle: {\n                                    fontSize: \'14\',\n                                    fontWeight: \'bold\'\n                                }\n                            }\n                        }\n                        ,\n                        labelLine: {\n                            normal: {\n                                show: false\n                            }\n                        }\n                        ,\n                        /*data:[\n                  {value:1, name:\'非常严重\'},\n                  {value:2, name:\'严重\'},\n                  {value:17, name:\'一般\'}\n                  ]*/\n                        data: [\n                            {\n                                value: unhealth, name: \'未启用节点\'\n                            }\n                            , {\n                                value: health, name: \'有效节点\'\n                            }\n                        ]\n                    }\n                ]\n            };\n            if ($(window).width() < 991) {\n                option.series[0].radius = [\'50%\', \'70%\'];\n            }\n            else {\n                option.series[0].radius = [\'60%\', \'100%\'];\n            }\n            $(window).resize(function () {\n                if ($(window).width() < 991) {\n                    option.series[0].radius = [\'50%\', \'70%\'];\n                }\n                else {\n                    option.series[0].radius = [\'60%\', \'100%\'];\n                }\n                myChart.setOption(option);\n            }\n            );\n            myChart.setOption(option);\n            window.onresize = function () {\n                myChart.resize();\n            }\n        }\n    }\n}\n);\n</script>\r\n<script id=\"3fcc632848js\">$.ajax({\n  url: $webpath + \"/resource/tenants\",\n  type: \'GET\',\n  success: function (result) {\n  if (result) {\n  var quotas = result.quotas;\n  var cpuBars = $(\".process-cpu .bars-container\");\n  var storageBars = $(\".process-storage .bars-container\");\n  var memoryBars = $(\".process-memory .bars-container\");\n  cpuBars.empty();\n  storageBars.empty();\n  memoryBars.empty();\n  $(\".quota-project-list\").empty();\n  var allQuota = result.allQuota;\n  //总额\n  var allQuota = allQuota ? allQuota : null;\n  var usedQuota = result.usedQuota ? result.usedQuota : null;\n  var colorArray = [\n  \'#0090f4\', \'#4dafff\', \'#90caf9\', \'#6e9be9\', \'#8cb9ff\', \'#868fff\', \'#6170ff\', \'#5f9bff\', \'#87d7f7\', \'#bcd8f5\', \'#2d79ef\'\n  ]\n  if (quotas && quotas.length > 0) {\n  var prevTenantUsedCPU = 0;\n  var prevTenantUsedStorage = 0;\n  var prevTenantUsedMemory = 0;\n  var prevTenantUsedCPUpercentage = 0;\n  var prevTenantUsedStoragepercentage = 0;\n  var prevTenantUsedMemorypercentage = 0;\n  for (var i = 0;\n  i < quotas.length;\n  i++) {\n  var backgroundColor = colorArray[i % colorArray.length];\n  var curTenant = quotas[i].tenantName;\n  var usedQuotaAttr = typeof (quotas[i].usedQuotaAttr) == \'string\' ? JSON.parse(quotas[i].usedQuotaAttr) : quotas[i].usedQuotaAttr;\n  var curTenantCpu = usedQuotaAttr.CPU;\n  var curTenantstorage = usedQuotaAttr.Storage;\n  var curTenantMemory = usedQuotaAttr.Memory;\n  curTenantCpuPercentage = ((Number(curTenantCpu) / Number(allQuota.CPU)) * 100).toFixed(2);\n  curTenantstoragePercentage = ((Number(curTenantstorage) / Number(allQuota.Storage)) * 100).toFixed(2);\n  curTenantMemoryPercentage = ((Number(curTenantMemory) / Number(allQuota.Memory)) * 100).toFixed(2);\n  // if ((Number(prevTenantUsedCPU) + Number(curTenantCpu)) == Number(allQuota.CPU)) {\n  //     curTenantCpuPercentage = Number(100 - prevTenantUsedCPUpercentage).toFixed(2);\n  // }\n  // if ((Number(prevTenantUsedStorage) + Number(curTenantstorage)) == Number(allQuota.Storage)) {\n  //     curTenantstoragePercentage = Number(100 - prevTenantUsedStoragepercentage).toFixed(2);\n  // }\n  // if ((Number(prevTenantUsedMemory) + Number(curTenantMemory)) == Number(allQuota.Memory)) {\n  //     curTenantMemoryPercentage = Number(100 - prevTenantUsedMemorypercentage).toFixed(2);\n  // }\n  appendQuotaHtml(backgroundColor, curTenant, curTenantCpuPercentage, curTenantstoragePercentage, curTenantMemoryPercentage);\n  prevTenantUsedCPU += Number(curTenantCpu);\n  prevTenantUsedStorage += Number(curTenantstorage);\n  prevTenantUsedMemory += Number(curTenantMemory);\n  prevTenantUsedCPUpercentage += Number(curTenantCpuPercentage);\n  prevTenantUsedStoragepercentage += Number(curTenantstoragePercentage);\n  prevTenantUsedMemorypercentage += Number(curTenantMemoryPercentage);\n  if (i >= 4) {\n  break;\n}\n       }\n       //其他\n       var otherCpuPercentage = ((Number(usedQuota ? usedQuota.CPU - prevTenantUsedCPU : 0) / Number(allQuota.CPU)) * 100).toFixed(2);\nvar otherstoragePercentage = ((Number(usedQuota ? usedQuota.Storage - prevTenantUsedStorage : 0) / Number(allQuota.Storage)) * 100).toFixed(2);\nvar otherMemoryPercentage = ((Number(usedQuota ? usedQuota.Memory - prevTenantUsedMemory : 0) / Number(allQuota.Memory)) * 100).toFixed(2);\nappendQuotaHtml(\'#2d79ef\', \'其他\', otherCpuPercentage, otherstoragePercentage, otherMemoryPercentage);\n// $(\".