INSERT INTO `page_model` VALUES ('9098acb68e7b11e9ab651402ec7d7650', 'admin', '2019-06-14 16:07:57', 'tenant_system', 'admin', '2019-06-14 16:39:32', '<script type=\"text/javascript\" id=\"809544c8739011e88b091402ec8b0a88\" data-count=\"0\" src=\"../../../v1/pageRes/res/file/809544c8739011e88b091402ec8b0a88\"></script>\r\n<script type=\"text/javascript\" id=\"bc4bde84aff611e88b091402ec8b0a88\" data-count=\"0\" src=\"../../../v1/pageRes/res/file/bc4bde84aff611e88b091402ec8b0a88\"></script>\r\n<script type=\"text/javascript\" id=\"3c2cf2bfedfa11e8a7821402ec81c25c\" data-count=\"0\" src=\"../../../v1/pageRes/res/file/3c2cf2bfedfa11e8a7821402ec81c25c\"></script>\r\n<script id=\"8d36cb5748js\">var myChart = echarts.init(document.getElementById(\"0e79a8c848\"));\noption = {\n  tooltip: {\n    trigger: \'item\',\n    formatter: \"{a} <br/>{b}: {c} ({d}%)\"\n  }\n  ,\n  legend: {\n    orient: \'vertical\',\n    x : \'right\',\n    y:\'center\',\n    left:\'60%\',\n    data:[\'非常严重\',\'严重\',\'一般\']\n  }\n  ,\n  color:[\'#d97a80\',\'#fec400\',\'#29cc97\'],\n  series: [\n    {\n      name:\'告警\',\n      type:\'pie\',\n      center: [\'30%\', \'50%\'],\n      radius: [\'60%\', \'100%\'],\n      hoverAnimation: false,\n      legendHoverLink:false,\n      avoidLabelOverlap: false,\n      label: {\n        normal: {\n          show: false,\n          position: \'center\'\n        }\n        ,\n        emphasis: {\n          show: true,\n          textStyle: {\n            fontSize: \'14\',\n            fontWeight: \'bold\'\n          }\n        }\n      }\n      ,\n      labelLine: {\n        normal: {\n          show: false\n        }\n      }\n      ,\n      data:[\n        {\n          value:1, name:\'非常严重\'}\n        ,\n        {\n          value:2, name:\'严重\'}\n        ,\n        {\n          value:17, name:\'一般\'}\n      ]\n    }\n  ]\n};\nif($(window).width() < 991) {\n  option.series[0].radius = [\'50%\', \'70%\'];\n}\nelse{\n  option.series[0].radius = [\'60%\', \'100%\'];\n}\n$(window).resize(function() {\n  if($(window).width() < 991) {\n    option.series[0].radius = [\'50%\', \'70%\'];\n  }\n  else{\n    option.series[0].radius = [\'60%\', \'100%\'];\n  }\n  myChart.setOption(option);\n}\n                );\nmyChart.setOption(option);\nwindow.onresize = function(){\n  myChart.resize();\n}\n</script>\r\n<script id=\"6a6c9cab48js\">$.ajax({\n  url: \"/security/rest/user/cnt\",\n  type: \"GET\",\n  success: function (data) {\n    $(\"#userNum\").text(data);\n  }\n}\n      )\n</script>\r\n<script id=\"73d8117948js\">$.ajax({\n  url: \"/security/rest/tenant/cnt\",\n  type: \"GET\",\n  success: function (data) {\n    $(\"#tenantNum\").text(data);\n  }\n}\n      )\n</script>\r\n<script id=\"4b0c004348js\">$(document).ready(function () {\n  getProductTable();\n}\n                 );\nfunction getProductTable() {\n  $(\"#e1caea0348\").bootstrapTable({\n    url: $webpath+\"/console/v1/product/allProductWithAuth\",\n    method: \"POST\",\n    contentType: \"application/json\",\n    dataType: \"json\",\n    classes: \'table-no-bordered\',\n    cache: false,\n    striped: false,\n    pagination: true,\n    pageNumber: 1,\n    pageSize: 10,\n    pageList: [10, 25, 50, 100],\n    queryParams: function (params) {\n    return JSON.stringify({\n    \"page\": {\n    \"pageNo\": (params.offset / params.limit) + 1,\n    \"pageSize\": params.limit\n  }\n                                  ,\n                                  \"dataAuth\": \"00\",\n                                  \"product\": {\n                                  \"productStatus\": \"30\",\n                                  \"productTypeId\": $(\'#svcManageSearchForm select[name=\"productTypeId\"]\').val(),\n    \"productName\": $(\'#svcManageSearchForm input[name=\"productName\"]\').val()\n}\n}\n)\n}\n,\n  queryParamsType: \'limit\',\n    responseHandler: function (res) {\n      return {\n        \"total\": res.totalCount,\n        \"rows\": res.list\n      }\n    }\n,\n  sidePaginati