INSERT INTO `page_model` VALUES ('96c007d1fde711e8ad011402ec81c25c', 'admin', '2019-08-12 10:47:43', 'tenant_system', 'admin', '2019-08-23 09:42:24', '<script type=\"text/javascript\" id=\"809544c8739011e88b091402ec8b0a88\" data-count=\"3\" src=\"../../../v1/pageRes/res/file/809544c8739011e88b091402ec8b0a88\"></script>\r\n<script type=\"text/javascript\" id=\"bc4bde84aff611e88b091402ec8b0a88\" data-count=\"0\" src=\"../../../v1/pageRes/res/file/bc4bde84aff611e88b091402ec8b0a88\"></script>\r\n<script type=\"text/javascript\" id=\"3c2cf2bfedfa11e8a7821402ec81c25c\" data-count=\"0\" src=\"../../../v1/pageRes/res/file/3c2cf2bfedfa11e8a7821402ec81c25c\"></script>\r\n<script id=\"9ecece1e48js\">$.ajax({\n  url: \"/portal/rest/message/querySysMsgInfo\",\n  type: \"GET\",\n  success: function (data) {\n    var str=\'\';\n    if(data.data && data.data.length> 0) {\n      $(data.data.slice(0,4)).each(function(index,item){\n        //str+=\'<p class=\"v-notifications\">【公告】<a href=\"/portal/announcement!list.action?onlyshow=true\">\'+item.msgTitle+\'</a></p>\';\n        str+=\'<span class=\"round-icon-point\"></span>\\n\' +\n          \'<p class=\"v-notification\">\\n\' +\n            \'    <span class=\"post_module_title\">\\n\' +\n              \'        <span>公告 | </span>\\n\' +\n                \'        <a href=\"/portal/message!listSysMsg.action\">\' + item.msgTitle+\'</a>\\n\' +\n                  \'    </span>\\n\' +\n                    \'    <span class=\"post_module_time\">\'+item.sendTime+\'</span>\\n\' +\n                      \'</p>\';\n      }\n                                  )\n      str+=\'<span class=\"round-icon-point look-all-icon\">\\n\' +\n        \'        </span>\\n\' +\n          \'        <p class=\"look-all-help\">\\n\' +\n            \'          <a href=\"/portal/message!listSysMsg.action\">查看全部  &gt;&gt;</a>\\n\' +\n              \'        </p>\';\n      $(\"#announcement .post_module_item\").html(str);\n      $(\'.post_module .v-notification\').eq(0).css(\'top\',\'-28px\');\n    }\n  }\n}\n      )\n</script>\r\n<script id=\"77d6a77b48js\">var serviceNum = 0;\n$.ajax({\n	url: $webpath + \"/bcos/v1/app/service/count\",\n	type: \'GET\',\n	async: false,\n	success: function (msg) {\n		var count = msg.data;\n		if (msg.code == \"200\") {\n			serviceNum += count.ctn;\n		}\n	}\n});\n$.ajax({\n	url: $webpath + \"/bcos/v1/component/service/caseCountsByTenant\",\n	type: \'GET\',\n	async: false,\n	success: function (data) {\n		if (data) {\n			serviceNum += data.count;\n		}\n	}\n})\n$(\"#serviceNum\").text(serviceNum);\n\n// $(\'#serviceNum\').parent().attr(\'href\',$webpath+\'/bcos/v1/app/service/servicePage\');\n//$(\'#serviceNum\').parent().on(\'click\',function () {\n//  window.location.href = $webpath+\'/bcos/v1/app/service/servicePage\';\n// window.parent.bcloudPathNavigation.titlePath = [];\n//}\n//                           );\n</script>\r\n<script id=\"7c34e5e948js\">$.ajax({\n  url: $webpath+\"/propconfig/specification/version\",\n  type: \'GET\',\n  dataType: \"json\",\n  contentType: \'application/json\',\n  success: function (res) {\n  if(res.code === 200) {\n  $(\'#footer-version .footer-version-info\').html(res.data);\n}\n       }\n       }\n      );\n</script>\r\n<script id=\"73d8117948js\">$.ajax({\n  url: \"/security/rest/tenant/cnt\",\n  type: \"GET\",\n  success: function (data) {\n    $(\"#tenantNum\").text(data);\n  }\n}\n      )\n</script>\r\n<script id=\"f981082948js\">$.ajax({\n  url: $webpath + \"/bcos/v1/appModel/countsByProject?projectId=\",\n  type: \'GET\',\n  contentType: \"application/json\",\n  dataType: \"json\",\n  success: function (data) {\n  $(\'#productNum\').html(data);\n}\n       }\n      );\n// $(\'#productNum\').parent().attr(\'href\',$webpath+\'/product/page\');\n$(\'#productNum\').parent().on(\'click\',function () {\n  window.location.href = $webpath+\'/application/manage\';\n  window.parent.bcloudPathNavigation.titlePath = [];\n}\n                            );\n</script>\r\n<script id=\"6a6c9cab48js\">$.ajax({\n  url: \"/security/rest/user/cnt\",\n  type: \"GET\",\n  success: function (data) {\n    $(\"#userNum\").text(data);\n  }\n}\n      )\n</script>\r\n<script id=\"f981082940js\">$.ajax({\n  url: $webpath + \"/console/v1/project/allProProject\",\n  type: \'POST\',\n  contentType: \"application/json\",\n  data: JSON.stringify({\n  \"pageNo\": 1, \"pageSize\": 10000 }\n      ),\n  success: function (res) {\n    if (res.code == 0) {\n      $(\"#projectNum\").text(res.data.total)\n    }\n  }\n}\n)\n</script>\r\n<script id=\"32864e0548js\">\n</script>\r\n<script id=\"89741cc348js\">var myChart = echarts.init(document.getElementById(\"7156e1a248\"));\n$.ajax({\n  url: $webpath + \'/resource/quota/nodes\',\n  type: \'GET\',\n  success: function (res) {\n  if (res.code == 200 && res.data) {\n  var health = 0;\n  var unhealth = 0;\n  if (res.data.health) {\n  health = res.data.health;\n}\n       if (res.data.unhealth) {\n  unhealth = res.data.unhealth;\n}\nvar allNodes = parseInt(health) + parseInt(unhealth);\nvar option = {\n  tooltip: {\n    trigger: \'item\',\n    formatter: \"{a} <br/>{b}: {c} ({d}%)\"\n  }\n  ,\n  legend: {\n    orient: \'vertical\',\n    x: \'right\',\n    y: \'center\',\n    left: \'70%\',\n    // data:[\'非常严重\',\'严重\',\'一般\']\n    data: [\'未启用节点\', \'有效节点\']\n  }\n  ,\n  graphic: {\n    type: \'text\',\n    left: \'center\',\n    top: \'center\',\n    style: {\n      text: allNodes + \'\\n节点数量\',\n      textAlign: \'center\',\n      fill: \'#737373\',\n      font: \'bolder 14px MicrosoftYaHei\'\n    }\n  }\n  ,\n  //color:[\'#d97a80\',\'#fec400\',\'#29cc97\'],\n  color: [\'#cfcfcf\', \"#4dafff\"],\n  series: [\n    {\n      name: \'集群节点\',\n      type: \'pie\',\n      center: [\'50%\', \'50%\'],\n      radius: [\'48px\', \'64px\'],\n      hoverAnimation: false,\n      legendHoverLink: false,\n      avoidLabelOverlap: false,\n      label: {\n        normal: {\n          show: false,\n          position: \'center\'\n        }\n        ,\n        emphasis: {\n          show: false,\n          textStyle: {\n            fontSize: \'14\',\n            fontWeight: \'bold\'\n          }\n        }\n      }\n      ,\n      labelLine: {\n        normal: {\n          show: false\n        }\n      }\n      ,\n      /*data:[\n{value:1, name:\'非常严重\'},\n{value:2, name:\'严重\'},\n{value:17, name:\'一般\'}\n]*/\n      data: [\n        {\n          value: unhealth, name: \'未启用节点\'\n        }\n        , {\n          value: health, name: \'有效节点\'\n        }\n      ]\n    }\n  ]\n};\n// if ($(window).width() < 991) {\n//     option.series[0].radius = [\'50%\', \'70%\'];\n// }\n// else {\n//     option.series[0].radius = [\'60%\', \'100%\'];\n// }\n// $(window).resize(function () {\n//     if ($(window).width() < 991) {\n//         option.series[0].radius = [\'50%\', \'70%\'];\n//     }\n//     else {\n//         option.series[0].radius = [\'60%\', \'100%\'];\n//     }\n//     myChart.setOption(option);\n// }\n// );\nmyChart.setOption(option);\nwindow.onresize = function () {\n  myChart.resize();\n}\n}\n}\n}\n);\n</script>\r\n<script id=\"3d9b295748js\">$.ajax({\n  url: $webpath + \"/resource/tenants\",\n  type: \'GET\',\n  success: function (result) {\n  if (result) {\n  var quotas = result.quotas;\n  $(\".quota-project-list\").empty();\n  var allQuota = result.allQuota;\n  //总额\n  var allQuota = allQuota ? allQuota : null;\n  var colorArray = [\n  \'#0090f4\', \'#4dafff\', \'#90caf9\', \'#6e9be9\', \'#8cb9ff\', \'#2d79ef\', \'#6170ff\', \'#5f9bff\', \'#87d7f7\', \'#bcd8f5\', \'#868fff\'\n  ]\n  var cpuData = [];\n  var memData = [];\n  var stroData = [];\n  if (quotas && quotas.length > 0) {\n  var prevTenantUsedCPU = 0;\n  var prevTenantUsedStorage = 0;\n  var prevTenantUsedMemory = 0;\n  for (var i = 0;\n  i < quotas.length;\n  i++) {\n  var backgroundColor = colorArray[i % colorArray.length];\n  var curTenant = quotas[i].tenantName;\n  var allQuotaAttr = typeof (quotas[i].allQuotaAttr) == \'string\' ? JSON.parse(quotas[i].allQuotaAttr) : quotas[i].allQuotaAttr;\n  var curTenantCpu = allQuotaAttr.CPU;\n  var curTenantstorage = allQuotaAttr.Storage;\n  var curTenantMemory = allQuotaAttr.Memory;\n  cpuData.push({\n  value: Number(curTenantCpu),\n  name: curTenant\n}\n      );\nmemData.push({\n  value: Number(curTenantMemory),\n  name: curTenant\n}\n            );\nstroData.push({\n  value: Number(curTenantstorage),\n  name: curTenant\n}\n             );\nappendQuotaHtml(backgroundColor, curTenant);\nprevTenantUsedCPU += Number(curTenantCpu);\nprevTenantUsedStorage += Number(curTenantstorage);\nprevTenantUsedMemory += Number(curTenantMemory);\nif (i >= 4) {\n  break;\n}\n}\n//其他\nvar otherCpu = Number(allQuota ? allQuota.CPU - prevTenantUsedCPU : 0);\nvar otherstorage = Number(allQuota ? allQuota.Storage - prevTenantUsedStorage : 0);\nvar otherMemory = Number(allQuota ? allQuota.Memory - prevTenantUsedMemory : 0);\ncpuData.push({\n  value: Number(otherCpu),\n  name: \'其他\'\n}\n            );\nmemData.push({\n  value: Number(otherMemory),\n  name: \'其他\'\n}\n            );\nstroData.push({\n  value: Number(otherstorage),\n  name: \'其他\'\n}\n             );\nappendQuotaHtml(\'#2d79ef\', \'其他\');\ndrawQuotaAllocationChart(\"cpuChart\", allQuota.CPU + \'\\nCPU(核)\', colorArray, \'CPU\', cpuData);\ndrawQuotaAllocationChart(\"memChart\", allQuota.Memory + \'\\n内存(GB)\', colorArray, \'内存\', memData);\ndrawQuotaAllocationChart(\"stroChart\", allQuota.Storage + \'\\n存储(GB)\', colorArray, \'存储\', stroData);\n}\n}\n}\n}\n)\nfunction appendQuotaHtml(backgroundColor, curTenant) {\n  $(\".quota-project-list\").append(\n    \'<div class=\"indicate-point\">\' +\n    \'    <span class=\"color\" style=\"background-color:\' + backgroundColor + \'\"></span>\' +\n    \'    <span class=\"name\">\' + curTenant + \'</span>\' +\n    \'</div>\')\n}\nfunction drawQuotaAllocationChart(id, graphicText, color, name, data) {\n  var quotaAllocationChart = echarts.init(document.getElementById(id));\n  var quotaAllocationOption = {\n    tooltip: {\n      trigger: \'item\',\n      position:\'right\',\n      formatter: \"{a} <br/>{b}: {c} ({d}%)\"\n    }\n    ,\n    legend: {\n      show: false,\n      orient: \'vertical\',\n      x: \'right\',\n      y: \'center\',\n      left: \'60%\',\n      // data:[\'非常严重\',\'严重\',\'一般\']\n    }\n    ,\n    graphic: {\n      type: \'text\',\n      left: \'center\',\n      top: \'center\',\n      style: {\n        text: graphicText,\n        textAlign: \'center\',\n        fill: \'#737373\',\n        font: \'bolder 14px MicrosoftYaHei\'\n      }\n    }\n    ,\n    color: color,\n    series: [\n      {\n        name: name,\n        type: \'pie\',\n        center: [\'50%\', \'50%\'],\n        radius: [\'48px\', \'64px\'],\n        hoverAnimation: false,\n        legendHoverLink: false,\n        avoidLabelOverlap: false,\n        label: {\n          normal: {\n            show: false,\n            position: \'center\'\n          }\n          ,\n          emphasis: {\n            show: false,\n            textStyle: {\n              fontSize: \'14\',\n              fontWeight: \'bold\'\n            }\n          }\n        }\n        ,\n        labelLine: {\n          normal: {\n            show: false\n          }\n        }\n        ,\n        data: data\n      }\n    ]\n  };\n  quotaAllocationChart.setOption(quotaAllocationOption);\n  window.onresize = function () {\n    quotaAllocationChart.resize();\n  }\n}\n</script>\r\n<script id=\"a87ed8c248js\">$(document).mousemove(function(e){\n  $(\".num-wrap\").hide();\n  if( $(e.target).hasClass(\"progress-bar\") ){\n    var X = $(e.target)[0].getBoundingClientRect().left;\n    var Y = $(e.target)[0].getBoundingClientRect().top;\n    var eX = e.clientX;\n    var show_left = eX - X;\n    var percent_number = $(e.target).find(\".num-wrap\");\n    var num_art = percent_number.find(\".art\");\n    var color = $(e.target).css(\"background-color\");\n    percent_number.css(\"left\"