").find(\".item-value .text\").text(usedStorage + \"/\" + storage);\n  ////memory\n  //$(\".process-memory\").find(\".progress-bar\").attr(\"aria-valuemax\", data.memory);\n  //$(\".process-memory\").find(\".progress-bar\").attr(\"aria-valuenow\", data.usedMemory);\n  //$(\".process-memory\").find(\".progress-bar\").css(\"width\", usedMemoryPer);\n  //$(\".process-memory\").find(\".percent_number\").text(usedMemoryPer);\n  //$(\".process-memory\").find(\".item-value .text\").text(usedMemory + \"/\" + memory);\n  var projectsAssigned = result.projectsAssigned;\n  var cpuBars = $(\".process-cpu .bars-container\");\n  var storageBars = $(\".process-storage .bars-container\");\n  var memoryBars = $(\".process-memory .bars-container\");\n  cpuBars.empty();\n  storageBars.empty();\n  memoryBars.empty();\n  $(\".quota-project-list\").empty();\n  var tenantQuota = JSON.parse(result.tenantQuota);\n  //总额\n  var projectsUsed = result.projectsUsed;\n  var projectsUsedOver = projectsUsed ? projectsUsed.over : null;\n  var projectsUsedUsed = projectsUsed ? projectsUsed.used : null;\n  var colorArray = [\n  \'#0090f4\', \'#4dafff\', \'#90caf9\', \'#6e9be9\', \'#8cb9ff\', \'#868fff\', \'#6170ff\', \'#5f9bff\', \'#87d7f7\', \'#bcd8f5\', \'#2d79ef\'\n  ]\n  if (projectsAssigned && projectsAssigned.length > 0) {\n  var prevProjectlUsedCPU = 0;\n  var prevProjectlUsedStorage = 0;\n  var prevProjectlUsedMemory = 0;\n  var prevProjectlUsedCPUpercentage = 0;\n  var prevProjectlUsedStoragepercentage = 0;\n  var prevProjectlUsedMemorypercentage = 0;\n  for (var i = 0;\n  i < projectsAssigned.length;\n  i++) {\n  var backgroundColor = colorArray[i % colorArray.length];\n  var curProject = \'\';\n  for (var key in projectsAssigned[i]) {\n  curProject = key;\n  $(\".quota-project-list\").append(\n  \'<div class=\"indicate-point\">\' +\n  \'    <span class=\"color\" style=\"background-color:\' + backgroundColor + \'\"></span>\' +\n  \'    <span class=\"name\">\' + key + \'</span>\' +\n  \'</div>\'\n  )\n}\n       var curProjectCpu =  typeof(projectsAssigned[i][curProject]) == \'string\' ?  JSON.parse(projectsAssigned[i][curProject])[\"CPU\"] : projectsAssigned[i][curProject];\nvar curProjectstorage = typeof(projectsAssigned[i][curProject]) == \'string\' ?  JSON.parse(projectsAssigned[i][curProject])[\"Storage\"] : projectsAssigned[i][curProject];\nvar curProjectMemory = typeof(projectsAssigned[i][curProject]) == \'string\' ?  JSON.parse(projectsAssigned[i][curProject])[\"Memory\"] : projectsAssigned[i][curProject];\ncurProjectCpuPercentage = ((Number(curProjectCpu) / Number(tenantQuota.CPU)) * 100).toFixed(2);\ncurProjectstoragePercentage = ((Number(curProjectstorage) / Number(tenantQuota.Storage)) * 100).toFixed(2);\ncurProjectMemoryPercentage = ((Number(curProjectMemory) / Number(tenantQuota.Memory)) * 100).toFixed(2);\nif( (Number(prevProjectlUsedCPU) + Number(curProjectCpu))  == Number(tenantQuota.CPU) ){\n  curProjectCpuPercentage = Number(100 - prevProjectlUsedCPUpercentage).toFixed(2);\n}\nif( (Number(prevProjectlUsedStorage) + Number(curProjectstorage))  == Number(tenantQuota.Storage) ){\n  curProjectstoragePercentage =  Number(100 - prevProjectlUsedStoragepercentage).toFixed(2);\n}\nif( (Number(prevProjectlUsedMemory) + Number(curProjectMemory))  == Number(tenantQuota.Memory) ){\n  curProjectMemoryPercentage =  Number(100 - prevProjectlUsedMemorypercentage).toFixed(2);\n}\nprevProjectlUsedCPU += Number(curProjectCpu);\nprevProjectlUsedStorage += Number(curProjectstorage);\nprevProjectlUsedMemory += Number(curProjectMemory);\nprevProjectlUsedCPUpercentage += Number(curProjectCpuPercentage);\nprevProjectlUsedStoragepercentage += Number(curProjectstoragePercentage);\nprevProjectlUsedMemorypercentage += Number(curProjectMemoryPercentage);\ncpuBars.append(\n  \'<div class=\"progress-bar\" role=\"progressbar\" aria-valuenow=\"60\" aria-valuemin=\"0\" aria-valuemax=\"100\" style=\"width: \' + curProjectCpuPercentage + \'%;background-color:\' + backgroundColor + \';\">\' +\n  \'    <span class=\"percent_number\">\' + curProjectCpuPercentage + \'%</span>\' +\n  \'</div>\'\n);\nstorageBars.append(\n  \'<div class=\"progress-bar\" role=\"progressbar\" aria-valuenow=\"60\" aria-valuemin=\"0\" aria-valuemax=\"100\" style=\"width: \' + curProjectstoragePercentage + \'%;background-color:\' + backgroundColor + \';\">\' +\n  \'    <span class=\"percent_number\">\' + curProjectstoragePercentage + \'%</span>\' +\n  \'</div>\'\n);\nmemoryBars.append(\n  \'<div class=\"progress-bar\" role=\"progressbar\" aria-valuenow=\"60\" aria-valuemin=\"0\" aria-valuemax=\"100\" style=\"width: \' + curProjectMemoryPercentage + \'%;background-color:\' + backgroundColor + \';\">\' +\n  \'    <span class=\"percent_number\">\' + curProjectMemoryPercentage + \'%</span>\' +\n  \'</div>\'\n);\n}\n}\n$(\".process-cpu\").find(\".item-value\").text((Number(projectsUsedOver ? projectsUsedOver.CPU : 0) + Number(projectsUsedUsed ? projectsUsedUsed.CPU : 0)) + \'/\' + Number(tenantQuota.CPU) + \'(核)\');\n$(\".process-storage\").find(\".item-value\").text((Number(projectsUsedOver ? projectsUsedOver.Storage : 0) + Number(projectsUsedUsed ? projectsUsedUsed.Storage : 0)) + \'/\' + Number(tenantQuota.Storage) + \'(GB)\');\n$(\".process-memory\").find(\".item-value\").text((Number(projectsUsedOver ? projectsUsedOver.Memory : 0) + Number(projectsUsedUsed ? projectsUsedUsed.Memory : 0)) + \'/\' + Number(tenantQuota.Memory) + \'(GB)\');\n}\n}\n}\n)\n}\n}\n);\n</script>\r\n<script id=\"4b0c004348js\">function getProductTable(productTypeId) {\n	$(\".productTable\").bootstrapTable({\n		url: $webpath + \"/bcos/v1/component/service/caseCountsByProduct\",\n		method: \"GET\",\n		contentType: \"application/json\",\n		dataType: \"json\",\n		classes: \'table-no-bordered\',\n		cache: false,\n		striped: false,\n		pagination: false,\n		pageNumber: 1,\n		pageSize: 100,\n		pageList: [10, 25, 50, 100],\n		paginationDetailHAlign: \'left\',\n		showJumpto: true,\n		paginationPreT