INSERT INTO `page_model` VALUES ('ed14c73bfe7811e8ad011402ec81c25c', 'admin', '2018-12-13 09:46:36', 'tenant_system', 'admin', '2019-07-18 11:53:27', '<script type=\"text/javascript\" id=\"809544c8739011e88b091402ec8b0a88\" data-count=\"0\" src=\"../../../v1/pageRes/res/file/809544c8739011e88b091402ec8b0a88\"></script>\r\n<script type=\"text/javascript\" id=\"bc4bde84aff611e88b091402ec8b0a88\" data-count=\"0\" src=\"../../../v1/pageRes/res/file/bc4bde84aff611e88b091402ec8b0a88\"></script>\r\n<script type=\"text/javascript\" id=\"3c2cf2bfedfa11e8a7821402ec81c25c\" data-count=\"0\" src=\"../../../v1/pageRes/res/file/3c2cf2bfedfa11e8a7821402ec81c25c\"></script>\r\n<script id=\"9ecece1e48js\">$.ajax({\n  url: \"/portal/rest/message/querySysMsgInfo\",\n  type: \"GET\",\n  success: function (data) {\n    var str=\'\';\n    if(data.data && data.data.length> 0) {\n      $(data.data.slice(0,4)).each(function(index,item){\n        //str+=\'<p class=\"v-notifications\">【公告】<a href=\"/portal/announcement!list.action?onlyshow=true\">\'+item.msgTitle+\'</a></p>\';\n        str+=\'<span class=\"round-icon-point\"></span>\\n\' +\n          \'<p class=\"v-notification\">\\n\' +\n            \'    <span class=\"post_module_title\">\\n\' +\n              \'        <span>公告 | </span>\\n\' +\n                \'        <a href=\"/portal/message!listSysMsg.action\">\' + item.msgTitle+\'</a>\\n\' +\n                  \'    </span>\\n\' +\n                    \'    <span class=\"post_module_time\">\'+item.sendTime+\'</span>\\n\' +\n                      \'</p>\';\n      }\n                                  )\n      str+=\'<span class=\"round-icon-point look-all-icon\">\\n\' +\n        \'        </span>\\n\' +\n          \'        <p class=\"look-all-help\">\\n\' +\n            \'          <a href=\"/portal/message!listSysMsg.action\">查看全部  &gt;&gt;</a>\\n\' +\n              \'        </p>\';\n      $(\"#announcement .post_module_item\").html(str);\n      $(\'.post_module .v-notification\').eq(0).css(\'top\',\'-28px\');\n    }\n  }\n}\n      )\n</script>\r\n<script id=\"77d6a77b40js\">$.ajax({\n  url: $webpath + \"/bcos/v1/appModel/countsByProject?projectId=\"+projectId,\n  type: \'GET\',\n  contentType: \"application/json\",\n  dataType: \"json\",\n  success: function (data) {\n  $(\'#applicationNum\').html(data);\n}\n       }\n      );\n\n$(\'#applicationNum\').parent().on(\'click\',function () {\n        window.location.href = $webpath+\'/application/manage\';\n        window.parent.bcloudPathNavigation.titlePath = [];\n    }\n);\n</script>\r\n<script id=\"77d6a77b48js\">var serviceNum = 0;\n$.ajax({\n  url: $webpath+\"/bcos/v1/app/service/count\",\n  type: \'GET\',\n  async: false,\n  success: function (msg) {\n  var count = msg.data;\n  if(msg.code == \"200\"){\n  serviceNum += count.ctn;\n}\n       }\n       }\n      );\n$.ajax({\n  type: \"GET\",\n  url: $webpath + \"/user/findCurUser\",\n  dataType: \"json\",\n  async: false,\n  success: function (data) {\n  tenantId = data.tenantId;\n  $.ajax({\n  url: $webpath + \"/bcos/v1/component/service/caseCountsByTenant?tenantId=\" + tenantId+\"&projectId=\"+projectId,\n  type: \'GET\',\n  async: false,\n  success: function (data) {\n  if(data){\n  serviceNum+=data.count;\n}\n       }\n       }\n      )\n}\n}\n);\n$(\"#serviceNum\").text(serviceNum);\n//$(\'#serviceNum\').parent().attr(\'href\',$webpath+\'/bcos/v1/app/service/servicePage\');\n//$(\'#serviceNum\').parent().on(\'click\',function () {\n//  window.location.href = $webpath+\'/bcos/v1/app/service/servicePage\';\n//  window.parent.bcloudPathNavigation.titlePath = [];\n//}\n//                            );\n</script>\r\n<script id=\"ad463c8548js\">$.ajax({\n  url:$webpath+\"/console/v1/project/selectOneProject?projectId=\"+projectId,\n  type:\"GET\",\n  contentType:\"application/json;charset=utf-8\",\n  success:function (data) {\n  var createDate = timestampToTime(data.data.createTime);\n  var str = \'<p class=\"v-notification\">\\n\' +\n  \'    项目名称：<span>\'+data.data.projectName+\'</span>\\n\' +\n  \'</p>\\n\' +\n  \'<p class=\"v-notification\">\\n\' +\n  \'    创建时间：<span>\'+createDate+\'</span>\\n\' +\n  \'</p>\\n\' +\n  \'<p class=\"v-notification\">\\n\' +\n  \'    项目描述：<span>\'+data.data.projectResume+\'</span>\\n\' +\n  \'</p>\';\n  $(\'#projectDetail\').html(str);\n}\n       }\n      );\n\n\n//时间戳转换\n    function timestampToTime(timestamp) {\n        var date = new Date(timestamp);//时间戳为10位需*1000，时间戳为13位的话不需乘1000\n        Y = date.getFullYear() + \'-\';\n        M = (date.getMonth()+1 < 10 ? \'0\'+(date.getMonth()+1) : date.getMonth()+1) + \'-\';\n        D = (date.getDate() < 10 ? \'0\'+date.getDate() : date.getDate()) + \' \';\n        h = (date.getHours() < 10 ? \'0\'+date.getHours() : date.getHours()) + \':\';\n        m = (date.getMinutes() < 10 ? \'0\'+date.getMinutes() : date.getMinutes()) + \':\';\n        s = (date.getSeconds() < 10 ? \'0\'+date.getSeconds() : date.getSeconds());\n        return Y+M+D+h+m+s;\n    }\n</script>\r\n<script id=\"8d36cb5748js\">var myChart = echarts.init(document.getElementById(\"0e79a8c848\"));\n    option = {\n        tooltip: {\n            trigger: \'item\',\n            formatter: \"{a} <br/>{b}: {c} ({d}%)\"\n        }\n        ,\n        legend: {\n            orient: \'vertical\',\n            x : \'right\',\n            y:\'center\',\n            left:\'60%\',\n            // data:[\'非常严重\',\'严重\',\'一般\']\n            data:[\'无告警\']\n        }\n        ,\n        //color:[\'#d97a80\',\'#fec400\',\'#29cc97\'],\n        color:[\'#cfcfcf\'],\n        series: [\n            {\n                name:\'告警\',\n                type:\'pie\',\n                center: [\'30%\', \'50%\'],\n                radius: [\'60%\', \'100%\'],\n                hoverAnimation: false,\n                legendHoverLink:false,\n                avoidLabelOverlap: false,\n                label: {\n                    normal: {\n                        show: false,\n                        position: \'center\'\n                    }\n                    ,\n                    emphasis: {\n                        show: true,\n                        textStyle: {\n                            fontSize: \'14\',\n                            fontWeight: \'bold\'\n                        }\n                    }\n                }\n                ,\n                labelLine: {\n                    normal: {\n                        show: false\n                    }\n                }\n                ,\n                /*data:[\n                    {value:1, name:\'非常严重\'},\n                    {value:2, name:\'严重\'},\n                    {value:17, name:\'一般\'}\n                ]*/\n                data:[\n                    {value:20, name:\'无告警\'}\n                ]\n            }\n        ]\n    };\n    if($(window).width() < 991) {\n        option.series[0].radius = [\'50%\', \'70%\'];\n    }\n    else{\n        option.series[0].radius = [\'60%\', \'100%\'];\n    }\n    $(window).resize(function() {\n            if($(window).width() < 991) {\n                option.series[0].radius = [\'50%\', \'70%\'];\n            }\n            else{\n                option.series[0].radius = [\'60%\', \'100%\'];\n            }\n            myChart.setOption(option);\n        }\n    );\n    myChart.setOption(option);\n    window.onresize = function(){\n        myChart.resize();\n    }</script>\r\n<script id=\"f981082948js\">//$(\"#projectUser\").attr(\'href\',$webpath+\'/console/v1/project/user/\'+projectId);\n$(\'#projectUser\').on(\'click\',function () {\n  window.location.href = $webpath+\'/console/v1/project/user/\'+projectId;\n  window.parent.bcloudPathNavigation.titlePath = [];\n}\n                    );\n$.ajax({\n  url:$webpath+\"/console/v1/project/selectAllUsers\",\n  type:\"GET\",\n  contentType:\"application/json; charset=utf-8\",\n  data: {\n  \"projectId\": projectId\n}\n       ,\n       success:function (result) {\n  if(result.code === 0) {\n    $(\'#memberNum\').html(result.data.length);\n  }\n}\n}\n)\n</script>\r\n<script id=\"7c34e5e948js\">$.ajax({\n  url: $webpath+\"/propconfig/specification/version\",\n  type: \'GET\',\n  dataType: \"json\",\n  contentType: \'application/json\',\n  success: function (res) {\n  if(res.code === 200) {\n  $(\'#footer-version .footer-version-info\').html(res.data);\n}\n       }\n       }\n      );\n</script>\r\n<script id=\"4b0c004348js\">function getProductTable(productTypeId) {\n  $(\".productTable\").bootstrapTable({\n    url: $webpath + \"/bcos/v1/component/service/caseCountsByProduct?projectId=\" + projectId,\n    method: \"GET\",\n    contentType: \"application/json\",\n    dataType: \"json\",\n    classes: \'table-no-bordered\',\n    cache: false,\n    striped: false,\n    pagination: false,\n    pageNumber: 1,\n    pageSize: 100,\n    pageList: [10, 25, 50, 100],\n    paginationDetailHAlign: \'left\',\n    showJumpto: true,\n    paginationPreText: \'<i class=\"fa fa-angle-left bconsole-left-arrow\" aria-hidden=\"true\"></i>\',\n    paginationNextText: \'<i class=\"fa fa-angle-right bconsole-left-arrow\" aria-hidden=\"true\"></i>\',\n    formatRecordsPerPage: function (pageNumber) {\n    // return \'每页显示 \' + pageNumber + \' 条记录\';\n    return \'\' + pageNumber + \'\';\n  }\n                                    ,\n                                    formatShowingRows: function (pageFrom, pageTo, totalRows) {\n    // return \'显示第 \' + pageFrom + \' 到第 \' + pageTo + \' 条记录，总共 \' + totalRows + \' 条记录\';\n    return \'共\' + totalRows + \'条\';\n  }\n  ,\n    queryParams: function (params) {\n      // return JSON.stringify({\n      // 	\"page\": {\n      // 		\"pageNo\": (params.offset / params.limit) + 1,\n      // 		\"pageSize\": 10\n      // 	},\n      // 	\"dataAuth\": \"00\",\n      // 	\"product\": {\n      // 		\"productStatus\": \"30\",\n      // 		\"productTypeId\": productTypeId ? productTypeId : \'\',\n      // 		\"productName\": $(\'#productNameInput\').val()\n      // 	}\n      // })\n    }\n  ,\n    queryParamsType: \'limit\',\n      responseHandler: function (res) {\n        loadProductBoxs(res);\n        return {\n          \"total\": Object.keys(res).length,\n          \"rows\": res\n        }\n      }\n  ,\n    sidePagination: \"server\",\n      clickToSelect: true,\n        uniqueId: \"productId\",\n          columns: [\n            // 	{\n            // 	field: \'productName\',\n            // 	title: \'服务名称\',\n            // 	align: \'center\',\n            // 	valign: \'middle\',\n            // 	formatter: function (value, row, index) {\n            // 		return \'<a href=\"javascript:;\" onclick=\"toProductApply(\\\'\' + row.productId + \'\\\',\\\'\' + row.productStatus + \'\\\')\">\'+ row.productName +\'</a>\';\n            // 	}\n            // }, {\n            // 	field: \'productId\',\n            // 	title: \'服务编码\',\n            // 	align: \'center\',\n            // 	valign: \'middle\'\n            // }, {\n            // 	field: \'productVersion\',\n            // 	title: \'版本号\',\n            // 	align: \'center\',\n            // 	valign: \'middle\'\n            // }, {\n            // 	field: \'productStatus \',\n            // 	title: \'服务状态\',\n            // 	align: \'center\',\n            // 	valign: \'middle\',\n            // 	formatter: function (value, row, index) {\n            // 		return svcStateConvert(row.productStatus);\n            // 	}\n            // }, {\n            // 	field: \'productTypeId \',\n            // 	title: \'服务类型\',\n            // 	align: \'center\',\n            // 	valign: \'middle\',\n            // 	formatter: function (value, row, index) {\n            // 		return row.productTypeName;\n            // 	}\n            // }, {\n            // 	field: \'orderType\',\n            // 	title: \'订购方式\',\n            // 	align: \'center\',\n            // 	valign: \'middle\',\n            // 	formatter: function (value, row, index) {\n            // 		for (var i = 0; i < allPorderWaysArr.length; i++) {\n            // 			if(allPorderWaysArr[i].pwaysType == row.orderType) {\n            // 				return allPorderWaysArr[i].pwaysName;\n            // 			}\n            // 		}\n            // 	}\n            // }, {\n            // 	field: \'createBy\',\n            // 	title: \'创建人\',\n            // 	align: \'center\',\n            // 	valign: \'middle\'\n            // }, {\n            // 	field: \'createDate\',\n            // 	title: \'创建时间\',\n            // 	align: \'center\',\n            // 	valign: \'middle\'\n            // }\n          ]\n}\n)\n}\n//加载boxs\n//加载boxs\nfunction loadProductBoxs(boxs) {\n  $(\".products-list\").empty();\n  if (boxs && !$.isEmptyObject(boxs)) {\n    $.each(boxs, function (key, value) {\n      var html = \'\';\n      if (value.details.productName) {\n        html += \'<a class=\"products-item-container col-xs-12 col-sm-6 col-md-3 col-lg-3\" title=\"单击\" href=\"\' + $webpath + \'/productCase/component/service?productId=\' + value.details.productId + \'\" onclick=\"window.parent.bcloudPathNavigation.titlePath = [];\">\';\n      }\n      else {\n        if (value.details.appType == \"2\") {\n          html += \'<a class=\"products-item-container col-xs-12 col-sm-6 col-md-3 col-lg-3\" title=\"单击\" href=\"\' + $webpath + \'/application/servflow/erteTest1?applicationId=\' + value.details.applicationId + \'\" onclick=\"window.parent.bcloudPathNavigation.titlePath = [];\">\';\n        }\n        else {\n          html += \'<a class=\"products-item-container col-xs-12 col-sm-6 col-md-3 col-lg-3\" title=\"单击\" href=\"\' + $webpath + \'/bcos/v1/app/service/servicePage?applicationId=\' + value.details.applicationId + \'\" onclick=\"window.parent.bcloudPathNavigation.titlePath = [];\">\';\n        }\n      }\n      var itemTitle = value.details.productName ? value.details.productName : value.details.appName;\n      html += \'<input type=\"text\" hidden value=\"\' + value.details.productId + \'\">\' 