INSERT INTO `page_model` VALUES ('f4c40643ba7c11e9986a1402ec7d7650', 'admin', '2019-08-09 16:09:05', 'tenant_system', 'admin', '2019-08-15 10:29:40', '<script id=\"0a77a2ca48js\">$(document).mousemove(function(e){\n    $(\".num-wrap\").hide();\n    if( $(e.target).hasClass(\"progress-bar\") ){\n        \n        var X = $(e.target)[0].getBoundingClientRect().left;\n        var Y = $(e.target)[0].getBoundingClientRect().top;\n\n        var eX = e.clientX;\n        var show_left = eX - X;\n        var percent_number = $(e.target).find(\".num-wrap\");\n        var num_art = percent_number.find(\".art\");\n        var color = $(e.target).css(\"background-color\");\n\n        percent_number.css(\"left\", (show_left - 50 ) + \"px\" );\n        // percent_number.css(\"top\", (Y - 31 ) + \"px\" );\n        \n        percent_number.css(\"background-color\", color );\n        num_art.css(\"background-color\", color );\n        percent_number.show();\n    }\n});\nvar machineResource = {\n  \"CPU\": 0,\n  \"Memory\": 0,\n  \"Storage\": 0\n};\n//机器资源\nvar allUsedQuota;\n//所有租户服务已用配额\n$.ajax({\n  url: $webpath + \"/resource/quota/tenants/occupy\",\n  type: \'GET\',\n  success: function (result) {\n  if (result) {\n  var quotas = result.quotas;\n  var cpuBars = $(\".process-cpu .bars-container\");\n  var storageBars = $(\".process-storage .bars-container\");\n  var memoryBars = $(\".process-memory .bars-container\");\n  cpuBars.empty();\n  storageBars.empty();\n  memoryBars.empty();\n  $(\".quota-project-list\").empty();\n  if (result.allQuota) {\n  machineResource.CPU = result.allQuota.CPU ? result.allQuota.CPU.total : 0;\n  machineResource.Memory = result.allQuota.Memory ? result.allQuota.Memory.total : 0;\n  machineResource.Storage = result.allQuota.Storage ? result.allQuota.Storage.total : 0;\n}\n       allUsedQuota = result.usedQuota;\n       //总额\n       var allQuota = machineResource ? machineResource : null;\n       var usedQuota = allUsedQuota ? allUsedQuota : null;\n       //刻度条\\总占比\n       var percent = getItemProcessHtml(allQuota, usedQuota);\nvar colorArray = [\n  \'#0090f4\', \'#4dafff\', \'#90caf9\', \'#6e9be9\', \'#8cb9ff\', \'#868fff\', \'#6170ff\', \'#5f9bff\', \'#87d7f7\', \'#bcd8f5\', \'#2d79ef\'\n]\nif (quotas && quotas.length > 0) {\n  var prevTenantUsedCPU = 0;\n  var prevTenantUsedStorage = 0;\n  var prevTenantUsedMemory = 0;\n  var prevTenantUsedCPUpercentage = 0;\n  var prevTenantUsedStoragepercentage = 0;\n  var prevTenantUsedMemorypercentage = 0;\n  for (var i = 0;\n       i < quotas.length;\n       i++) {\n    var backgroundColor = colorArray[i % colorArray.length];\n    var curTenant = quotas[i].tenantName;\n    var usedQuotaAttr = typeof (quotas[i].usedQuotaAttr) == \'string\' ? JSON.parse(quotas[i].usedQuotaAttr) : quotas[i].usedQuotaAttr;\n    var curTenantCpu = usedQuotaAttr.CPU;\n    var curTenantstorage = usedQuotaAttr.Storage;\n    var curTenantMemory = usedQuotaAttr.Memory;\n    curTenantCpuPercentage = ((Number(curTenantCpu) / Number(allQuota.CPU)) * 100).toFixed(2);\n    curTenantstoragePercentage = ((Number(curTenantstorage) / Number(allQuota.Storage)) * 100).toFixed(2);\n    curTenantMemoryPercentage = ((Number(curTenantMemory) / Number(allQuota.Memory)) * 100).toFixed(2);\n    appendQuotaHtml(backgroundColor, curTenant, percent, curTenantCpuPercentage, curTenantstoragePercentage, curTenantMemoryPercentage);\n    prevTenantUsedCPU += Number(curTenantCpu);\n    prevTenantUsedStorage += Number(curTenantstorage);\n    prevTenantUsedMemory += Number(curTenantMemory);\n    prevTenantUsedCPUpercentage += Number(curTenantCpuPercentage);\n    prevTenantUsedStoragepercentage += Number(curTenantstoragePercentage);\n    prevTenantUsedMemorypercentage += Number(curTenantMemoryPercentage);\n    if (i >= 4) {\n      break;\n    }\n  }\n  //其他\n  var otherCpuPercentage = ((Number(usedQuota ? usedQuota.CPU - prevTenantUsedCPU : 0) / Number(allQuota.CPU)) * 100).toFixed(2);\n  var otherstoragePercentage = ((Number(usedQuota ? usedQuota.Storage - prevTenantUsedStorage : 0) / Number(allQuota.Storage)) * 100).toFixed(2);\n  var otherMemoryPercentage = ((Number(usedQuota ? usedQuota.Memory - prevTenantUsedMemory : 0) / Number(allQuota.Memory)) * 100).toFixed(2);\n  appendQuotaHtml(\'#2d79ef\', \'其他\', percent, otherCpuPercentage, otherstoragePercentage, otherMemoryPercentage);\n}\n$(\".process-cpu\").find(\".item-value\").html(\'<span style=\"\' + (Number(usedQuota ? usedQuota.CPU : 0) > Number(allQuota.CPU) ? \"color: #e95658;\" : \"\") + \'\">\' + Number(usedQuota ? usedQuota.CPU : 0) + \'</span>/\' + Number(allQuota.CPU) + \'(核)\');\n$(\".process-storage\").find(\".item-value\").html(\'<span style=\"\' + (Number(usedQuota ? usedQuota.Storage : 0) > Number(allQuota.Storage) ? \"color: #e95658;\" : \"\") + \'\">\' + Number(usedQuota ? usedQuota.Storage : 0) + \'</span>/\' + Number(allQuota.Storage) + \'(GB)\');\n$(\".process-memory\").find(\".item-value\").html(\'<span style=\"\' + (Number(usedQuota ? usedQuota.Memory : 0) > Number(allQuota.Memory) ? \"color: #e95658;\" : \"\") + \'\">\' + Number(usedQuota ? usedQuota.Memory : 0) + \'</span>/\' + Number(allQuota.Memory) + \'(GB)\');\n}\n}\n}\n)\nfunction appendQuotaHtml(backgroundColor, curTenant, percent, curTenantCpuPercentage, curTenantstoragePercentage, curTenantMemoryPercentage) {\n  $(\".quota-project-list\").append(\n    \'<div class=\"indicate-point\">\' +\n    \'    <span class=\"color\" style=\"background-color:\' + backgroundColor + \'\"></span>\' +\n    \'    <span class=\"name\">\' + curTenant + \'</span>\' +\n    \'</div>\');\n  $(\".process-cpu .bars-container\").append(\n    \'<div class=\"progress-bar\" role=\"progressbar\" aria-valuenow=\"60\" aria-valuemin=\"0\" aria-valuemax=\"100\" style=\"width: \' + (curTenantCpuPercentage / percent * 100).toFixed(2) + \'%;background-color:\' + backgroundColor + \';\">\' +\n    \'    <div class=\"num-wrap\"><span class=\"percent_number\">\' + curTenantCpuPercentage + \'%</span><span class=\"art\"></span></div>\' +\n      \'</div>\'\n    );\n  $(\".process-storage .bars-container\").append(\n    \'<div class=\"progress-bar\" role=\"progressbar\" aria-valuenow=\"60\" aria-valuemin=\"0\" aria-valuemax=\"100\" style=\"width: \' + (curTenantstoragePercentage / percent * 100).toFixed(2) + \'%;background-color:\' + backgroundColor + \';\">\' +\n    \'    <div class=\"num-wrap\"><span class=\"percent_number\">\' + curTenantstoragePercentage + \'%</span><span class=\"art\"></span></div>\' +\n      \'</div>\'\n    );\n  $(\".process-memory .bars-container\").append(\n    \'<div class=\"progress-bar\" role=\"progressbar\" aria-valuenow=\"60\" aria-valuemin=\"0\" aria-valuemax=\"100\" style=\"width: \' + (curTenantMemoryPercentage / percent * 100).toFixed(2) + \'%;background-color:\' + backgroundColor + \';\">\' +\n    \'    <div class=\"num-wrap\"><span class=\"percent_number\">\' + curTenantMemoryPercentage + \'%</span><span class=\"art\"></span></div>\' +\n      \'</div>\'\n    );\n}\n// function appendQuotaHtml(backgroundColor, curTenant, percent, curTenantCpuPercentage, curTenantstoragePercentage, curTenantMemoryPercentage) {\n//     $(\".quota-project-list\").append(\n//       \'<div class=\"indicate-point\">\' +\n//       \'    <span class=\"color\" style=\"background-color:\' + backgroundColor + \'\"></span>\' +\n//       \'    <span class=\"name\">\' + curTenant + \'</span>\' +\n//       \'</div>\')\n//     $(\".process-cpu .bars-container\").append(\n//       \'<div class=\"progress-bar\" role=\"progressbar\" aria-valuenow=\"60\" aria-valuemin=\"0\" aria-valuemax=\"100\" style=\"width: \' + (curTenantCpuPercentage / percent * 100).toFixed(2) + \'%;background-color:\' + backgroundColor + \';\">\' +\n//       \'    <span class=\"percent_number\">\' + curTenantCpuPercentage + \'%</span>\' +\n//         \'</div>\');\n//     $(\".process-storage .bars-container\").append(\n//       \'<div class=\"progress-bar\" role=\"progressbar\" aria-valuenow=\"60\" aria-valuemin=\"0\" aria-valuemax=\"100\" style=\"width: \' + (curTenantstoragePercentage / percent * 100).toFixed(2) + \'%;background-color:\' + backgroundColor + \';\">\' +\n//       \'    <span class=\"percent_number\">\' + curTenantstoragePercentage + \'%</span>\' +\n//         \'</div>\');\n//     $(\".process-memory .bars-container\").append(\n//       \'<div class=\"progress-bar\" role=\"progressbar\" aria-valuenow=\"60\" aria-valuemin=\"0\" aria-valuemax=\"100\" style=\"width: \' + (curTenantMemoryPercentage / percent * 100).toFixed(2) + \'%;background-color:\' + backgroundColor + \';\">\' +\n//       \'    <span class=\"percent_number\">\' + curTenantMemoryPercentage + \'%</span>\' +\n//         \'</div>\');\n//   }\nfunction getItemProcessHtml(machineResource, allUsedQuota) {\n  var interval = 10;\n  var cpuPercent = Math.ceil((Number(allUsedQuota ? allUsedQuota.CPU : 0) / Number(machineResource ? machineResource.CPU : 0)) * 100);\n  var memPercent = Math.ceil((Number(allUsedQuota ? allUsedQuota.Memory : 0) / Number(machineResource ? machineResource.Memory : 0)) * 100);\n  var stroPercent = Math.ceil((Number(allUsedQuota ? allUsedQuota.Storage : 0) / Number(machineResource ? machineResource.Storage : 0)) * 100);\n  console.log(cpuPercent)\n  console.log(memPercent)\n  console.log(stroPercent)\n  if (cpuPercent > 100 || memPercent > 100 || stroPercent > 100) {\n    var maxPercent = cpuPercent;\n    if (memPercent > maxPercent) {\n      maxPercent = memPercent;\n    }\n    if (stroPercent > maxPercent) {\n      maxPercent = stroPercent;\n    }\n    interval = Math.ceil(maxPercent / 10);\n  }\n  var html = \'\';\n  var num = 0;\n  html += \'<div class=\"line-0 c-line\" style=\"border-left:none;\">\\n\' +\n    \'        <span class=\"inner-number\">0%</span>\\n\' +\n      \'    </div>\\n\';\n  for (let i = 1; i < 9; i++) {\n    num += interval;\n    html += \'<div class=\"line-\' + i + \' c-line\">\\n\' +\n      \'         <span class=\"inner-number\">\' + (i % 2 == 0 ? num + \"%\" : \'\') + \'</span>\\n\' +\n        \'    </div>\\n\';\n  }\n  html += \'<div class=\"line-9 c-line\">\\n\' +\n    \'        <span class=\"inner-number\"></span>\\n\' +\n      \'        <span class=\"lat-number\">\' + (num + interval + interval) + \'%</span>\\n\' +\n        \'    </div>\\n\';\n  // return html;\n  $(\"#subscript\").html(html);\n  return maxPercent > 100 ? maxPercent : 100;\n}\n</script>\r\n', 'index', '0', '<style id=\"0a77a2ca48cs\">.panel .quota-btn {\n  display: inline-block;\n  height: 30px;\n  line-height: 27px;\n  font-size: 14px;\n  width: 80px;\n  background-color: #fff;\n  border: 2px solid #1B9AF7;\n  cursor: pointer;\n  color: #1B9AF7;\n  border-radius: 4px;\n  font-weight: 600;\n  -webkit-transition-property: all;\n  transition-property: all;\n  -webkit-transition-duration: .3s;\n  transition-duration: .3s;\n  position: absolute;\n  right: 15px;\n  top: 4px;\n  text-decoration: none;\n  outline: none;\n  text-align: center;\n}\n.panel .quota-btn:hover {\n  background-color: rgba(76, 176, 249, 0.9);\n  color: rgba(255, 255, 255, 0.9);\n  !important\n  border-color: #4cb0f9;\n  text-decoration: none;\n  outline: none;\n  text-align: center;\n  line-height: 27px;\n  font-size: 14px;\n}\n.progress{\n  background-color:#e4e8ef;\n}\n.resource-usage{\n}\n.resource-usage .panel-heading{\n  position: relative;\n}\n/*.resource-usage .panel-heading:before{\ncontent: \'\';\ndisplay:inline-block;\nposition: absolute;\nleft: -3px;\ntop: -3px;\nbackground: url(\'../../../theme/default/img/pageModel/content_sprite_01.png\') 0 -51px no-repeat;\nwidth: 50px;\nheight: 60px;\nmargin-right: 10px;\nvertical-align: text-bottom;\n}*/\n.resource-usage .panel-body .row{\n  margin: 0 -10px;\n}\n.panel a,.panel a:hover,.panel a:focus {\n  text-decoration:none;\n  font-family: \"Helvetica Neue\", Helvetica, Arial, sans-serif;\n  font-size: 14px;\n  line-height: 1.42857143;\n  color: #333;\n  background-color: #fff;\n}\n.view-more-b