DROP TABLE IF EXISTS `quality_code_quality`;
CREATE TABLE `quality_code_quality` (
  `id` varchar(32) NOT NULL,
  `task_id` varchar(32) DEFAULT NULL COMMENT '任务ID',
  `task_name` varchar(255) DEFAULT NULL COMMENT '检查任务',
  `service_name` varchar(255) DEFAULT NULL COMMENT '服务名称',
  `task_language` varchar(10) DEFAULT NULL COMMENT '语言',
  `quality_grade` varchar(10) DEFAULT NULL COMMENT '质量等级',
  `quality_rate` varchar(10) DEFAULT NULL COMMENT '与上次比较趋势',
  `code_num` int(12) DEFAULT NULL COMMENT '代码行数',
  `problem_num` int(12) DEFAULT NULL COMMENT '问题总数',
  `blocker_num` int(12) DEFAULT NULL COMMENT 'BLOCKER问题数',
  `critical_num` int(12) DEFAULT NULL COMMENT 'CRITICAL问题数',
  `major_num` int(12) DEFAULT NULL COMMENT 'MAJOR问题数',
  `minor_num` int(12) DEFAULT NULL COMMENT 'MINOR问题数',
  `info_num` int(12) DEFAULT NULL COMMENT 'INFO问题数',
  `application_id` varchar(32) DEFAULT NULL COMMENT '应用id',
  `tenant_id` varchar(32) DEFAULT NULL COMMENT '租户id',
  `service_id` varchar(32) DEFAULT NULL COMMENT '服务id',
  `project_id` varchar(32) DEFAULT NULL COMMENT '项目id',
  `create_date` datetime DEFAULT NULL,
  `record_date` date DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
-- Table structure for quality_project_quato
-- ----------------------------
DROP TABLE IF EXISTS `quality_project_quato`;
CREATE TABLE `quality_project_quato` (
  `id` varchar(32) NOT NULL,
  `project_id` varchar(32) DEFAULT NULL,
  `project_name` varchar(50) DEFAULT NULL,
  `all_quota_attr` text,
  `used_quota_attr` text,
  `over_quota_attr` text,
  `tenant_id` varchar(32) NOT NULL,
  `create_date` datetime DEFAULT NULL,
  `record_date` date DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
-- Table structure for quality_service_join
-- ----------------------------
DROP TABLE IF EXISTS `quality_service_join`;
CREATE TABLE `quality_service_join` (
  `id` varchar(32) NOT NULL,
  `service_name` varchar(50) DEFAULT NULL COMMENT '服务名称',
  `ci_num` int(11) DEFAULT NULL COMMENT '构建次数',
  `ci_suc_num` int(11) DEFAULT NULL COMMENT '构建成功次数',
  `ci_err_num` int(11) DEFAULT NULL COMMENT '构建失败次数',
  `ci_suc_rate` double(10,2) DEFAULT NULL COMMENT '构建成功率',
  `tenant_id` varchar(32) DEFAULT NULL COMMENT '租户id',
  `service_id` varchar(32) DEFAULT NULL COMMENT '服务id',
  `image_name` varchar(255) DEFAULT NULL COMMENT '镜像名称',
  `application_id` varchar(32) DEFAULT NULL COMMENT '应用id',
  `project_id` varchar(32) DEFAULT NULL COMMENT '项目id',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `deploy_num` int(11) DEFAULT '0' COMMENT '部署次数',
  `deploy_suc_num` int(11) DEFAULT '0' COMMENT '部署成功次数',
  `deploy_err_num` int(11) DEFAULT '0' COMMENT '部署失败次数',
  `deploy_suc_rate` double(10,2) DEFAULT '0.00' COMMENT '部署成功率',
  `record_date` date DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS `service_operation_log`;
CREATE TABLE `service_operation_log` (
  `id` varchar(32) NOT NULL,
  `service_id` varchar(32) DEFAULT NULL,
  `service_name` varchar(50) DEFAULT NULL,
  `tenant_id` varchar(32) DEFAULT NULL,
  `operation_type` varchar(11) DEFAULT NULL,
  `service_type` varchar(11) DEFAULT NULL,
  `operation_result` varchar(11) DEFAULT NULL,
  `service_extra_info` text,
  `project_id` varchar(32) DEFAULT NULL,
  `application_id` varchar(32) DEFAULT NULL,
  `create_by` varchar(50) DEFAULT NULL,
  `create_time` datetime DEFAULT NULL,
  `update_time` datetime DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `idx_serviceId` (`service_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

